(9, 1, 'Humanscale', '&lt;p&gt;Humanscale is the leading designer and manufacturer of ergonomic products that improve the health and comfort of work life.&lt;/p&gt;\r\n\r\n&lt;p&gt;The Humanscale Design Studio, based in New York City, abides by the philosophy that good design achieves more with less. Function, simplicity, and longevity, and sustainability are at the core of all our designs. When thinking through the design and manufacturing of each product, we carefully consider the materials and resources used, in aim of creating an overall Net Positive impact.&lt;/p&gt;', 'Humanscale', '', ''),
(11, 1, 'shop banner', '', 'shop banner', 'Office furniture solution| Framery acoustic phone booth| Humanscale Ergonomic Accessories| Datumstruct Solution', '');
