INSERT INTO `datumstruct_modification` (`modification_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES
(1, 'd_twig_manager', 'd_twig_manager', 'Dreamvention', '1.0.0', 'http://dreamvention.com', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>d_twig_manager</name>\n    <code>d_twig_manager</code>\n    <description>Adds support for twig templating engine</description>\n    <version>1.0.0</version>\n    <author>Dreamvention</author>\n    <link>http://dreamvention.com</link>\n    <file path=\"system/engine/loader.php\">\n        <operation error=\"skip\" info=\"add event support for 2.1.0.0 and below\">\n            <search><![CDATA[$file = DIR_TEMPLATE . $template;]]></search>\n            <add position=\"before\"><![CDATA[\n            //d_twig_manager.xml 1\n            $output = $this->controller(\'event/d_twig_manager/support\', array(\'route\' => $template, \'data\' => $data));\n            if($output || !file_exists( DIR_TEMPLATE . $template)){\n                return $output;\n            }\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"add event support for 2.2.0.0 and above\">\n            <search><![CDATA[$output = $template->render($route . \'.tpl\']]></search>\n            <add position=\"before\"><![CDATA[\n            //d_twig.xml 2\n\n            $output = $this->controller(\'event/d_twig_manager/support\', array(\'route\' => $route, \'data\' => $data));\n            if(!$output && file_exists( DIR_TEMPLATE . $route . \'.tpl\'))\n            ]]></add>\n        </operation>\n    </file>\n</modification>', 1, '2019-12-11 10:36:53'),
(2, 'Local copy OCMOD by iSenseLabs', 'isensealabs_quickfix_ocmod', 'iSenseLabs', '1.3', 'http://isenselabs.com', '<modification>\r\n    <name>Local copy OCMOD by iSenseLabs</name>\r\n	<version>1.3</version>\r\n	<link>http://isenselabs.com</link>\r\n	<author>iSenseLabs</author>\r\n	<code>isensealabs_quickfix_ocmod</code>\r\n\r\n	<file path=\"admin/controller/extension/installer.php\">\r\n		<operation error=\"skip\">\r\n			<search ><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/ftp\', \'token=\' . $this->session->data[\'token\'],]]></search>\r\n			<add position=\"replace\"><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/localcopy\', \'token=\' . $this->session->data[\'token\'],]]></add>\r\n		</operation>\r\n\r\n		<operation>\r\n			<search><![CDATA[public function unzip() {]]></search>\r\n			<add position=\"before\"><![CDATA[			\r\n	public function localcopy() {\r\n		$this->load->language(\'extension/installer\');\r\n\r\n		$json = array();\r\n\r\n		if (!$this->user->hasPermission(\'modify\', \'extension/installer\')) {\r\n			$json[\'error\'] = $this->language->get(\'error_permission\');\r\n		}\r\n\r\n		if (VERSION == \'2.0.0.0\') {\r\n		    $directory = DIR_DOWNLOAD  . str_replace(array(\'../\', \'..\\\\\', \'..\'), \'\', $this->request->post[\'path\']) . \'/upload/\';\r\n		} else {\r\n		    $directory = DIR_UPLOAD  . str_replace(array(\'../\', \'..\\\\\', \'..\'), \'\', $this->request->post[\'path\']) . \'/upload/\';\r\n		}\r\n\r\n		if (!is_dir($directory)) {\r\n			$json[\'error\'] = $this->language->get(\'error_directory\');\r\n		}\r\n\r\n		if (!$json) {\r\n			// Get a list of files ready to upload\r\n			$files = array();\r\n\r\n			$path = array($directory . \'*\');\r\n\r\n			while (count($path) != 0) {\r\n				$next = array_shift($path);\r\n\r\n				foreach (glob($next) as $file) {\r\n					if (is_dir($file)) {\r\n						$path[] = $file . \'/*\';\r\n					}\r\n\r\n					$files[] = $file;\r\n				}\r\n			}\r\n\r\n			$root = dirname(DIR_APPLICATION).\'/\';\r\n\r\n			foreach ($files as $file) {\r\n				// Upload everything in the upload directory\r\n				$destination = substr($file, strlen($directory));\r\n\r\n				// Update from newer OpenCart versions:\r\n				if (substr($destination, 0, 5) == \'admin\') {\r\n					$destination = DIR_APPLICATION . substr($destination, 5);\r\n				} else if (substr($destination, 0, 7) == \'catalog\') {\r\n					$destination = DIR_CATALOG . substr($destination, 7);\r\n				} else if (substr($destination, 0, 5) == \'image\') {\r\n					$destination = DIR_IMAGE . substr($destination, 5);\r\n				} else if (substr($destination, 0, 6) == \'system\') {\r\n					$destination = DIR_SYSTEM . substr($destination, 6);\r\n				} else {\r\n					$destination = $root.$destination;\r\n				}\r\n\r\n				if (is_dir($file)) {\r\n					if (!file_exists($destination)) {\r\n						if (!mkdir($destination)) {\r\n							$json[\'error\'] = sprintf($this->language->get(\'error_ftp_directory\'), $destination);\r\n						}\r\n					}\r\n				}\r\n\r\n				if (is_file($file)) {\r\n					if (!copy($file, $destination)) {\r\n						$json[\'error\'] = sprintf($this->language->get(\'error_ftp_file\'), $file);\r\n					}\r\n				}\r\n			}\r\n		}\r\n\r\n		$this->response->addHeader(\'Content-Type: application/json\');\r\n		$this->response->setOutput(json_encode($json));\r\n	}]]></add>\r\n		</operation>\r\n	</file>	\r\n</modification>', 1, '2020-09-04 18:34:33'),
(4, 'Удаление модулей', 'isensealabs_extension_uninstaller', 'iSenseLabs', '2', '', '<modification>\n    <name>Удаление модулей</name>\n	<version>2</version>\n	<link></link>\n	<author>iSenseLabs</author>\n	<code>isensealabs_extension_uninstaller</code>\n\n	<file path=\"admin/controller/extension/installer.php\">\n		<operation>\n			<search ><![CDATA[$data[\'header\'] = $this->load->controller(\'common/header\');]]></search>\n			<add position=\"before\"><![CDATA[\n		if ($this->request->get[\'route\'] == \'extension/installer/do_uninstall\') {\n          $this->document->setTitle($this->language->get(\'heading_title_uninstaller\'));\n          $data[\'heading_title\'] = $this->language->get(\'heading_title_uninstaller\');\n          $data[\'entry_overwrite\'] = $this->language->get(\'entry_unlink\');\n		}]]></add>\n		</operation>\n      \n		<operation>\n			<search ><![CDATA[$data[\'token\'] = $this->session->data[\'token\'];]]></search>\n			<add position=\"before\"><![CDATA[\n		if ($this->request->get[\'route\'] == \'extension/installer/do_uninstall\') {\n        	array_pop($data[\'breadcrumbs\']);\n			$data[\'breadcrumbs\'][] = array(\n                \'text\' => $this->language->get(\'heading_title_uninstaller\'),\n                \'href\' => $this->url->link(\'extension/installer/do_uninstall\', \'token=\' . $this->session->data[\'token\'], \'SSL\')\n            );\n		}]]></add>\n		</operation>\n            \n      	<operation>\n			<search ><![CDATA[move_uploaded_file($this->request->files[\'file\'][\'tmp_name\'], $file);]]></search>\n			<add position=\"after\"><![CDATA[				if (basename($file) == \'install.xml\' && !empty($this->request->server[\'HTTP_REFERER\']) && strpos($this->request->server[\'HTTP_REFERER\'], \'do_uninstall\') !== false) {\n          $dom = new DOMDocument(\'1.0\', \'UTF-8\');\n          $dom->loadXml(file_get_contents($file));\n\n          $code = $dom->getElementsByTagName(\'code\')->item(0);\n          if ($code) {\n            $code = $code->nodeValue;\n            $this->load->model(\'extension/modification\');\n            $modification_info = $this->model_extension_modification->getModificationByCode($code);\n            if ($modification_info) {\n	            array_unshift($json[\'overwrite\'], \'Modification: \' . $modification_info[\'name\']);\n            }\n          }\n        }]]></add>\n		</operation>\n      \n      	<operation>\n			<search ><![CDATA[$zip_name = zip_entry_name($entry);]]></search>\n			<add position=\"after\"><![CDATA[							if ($this->is_uninstall_request()) {\n							if (!isset($this->session->data[\'ext_uninstaller\'][\'modification_files\'])) $this->session->data[\'ext_uninstaller\'][\'modification_files\'] = array();\n							if (!isset($this->session->data[\'ext_uninstaller\'][\'modification_ids\'])) $this->session->data[\'ext_uninstaller\'][\'modification_ids\'] = array();\n\n							$is_modification_file = false;\n								if (strrchr($zip_name, \'.\') == \'.xml\') {\n                                  $this->load->model(\'extension/modification\');\n                                  $xml = zip_entry_read($entry, zip_entry_filesize($entry));\n\n                                  if ($xml) {\n                                      try {\n                                        $dom = new DOMDocument(\'1.0\', \'UTF-8\');\n                                        $dom->loadXml($xml);\n\n                                        $modification_tag = $dom->getElementsByTagName(\'modification\')->item(0);\n                                        if ($modification_tag) {\n                                            $is_modification_file = true;\n                                        }\n\n                                        $code = $dom->getElementsByTagName(\'code\')->item(0);\n                                        if ($code) {\n                                            $code = $code->nodeValue;\n											$modification_info = $this->model_extension_modification->getModificationByCode($code);\n											if ($modification_info) {\n												$this->session->data[\'ext_uninstaller\'][\'modification_ids\'][] = $modification_info[\'modification_id\'];\n												array_unshift($json[\'overwrite\'], \'Modification: \' . $modification_info[\'name\']);\n											}\n                                        }\n                                    } catch (Exception $e) {\n                                    }\n                                  }\n								}\n                          	$file = dirname(DIR_APPLICATION) . DIRECTORY_SEPARATOR . substr($zip_name, 7);\n                          	if (is_file($file)) {\n								if ($is_modification_file) {\n									array_unshift($json[\'overwrite\'], \'Modification file: \' . substr($zip_name, 7));\n									$this->session->data[\'ext_uninstaller\'][\'modification_files\'][] = $file;\n								} else {\n									$json[\'overwrite\'][] = substr($zip_name, 7);\n								}\n							}\n                          	continue;\n							}]]></add>\n		</operation>\n      \n        <operation>\n			<search ><![CDATA[$json[\'success\'] = $this->language->get(\'text_success\');]]></search>\n			<add position=\"after\"><![CDATA[			$json[\'success\'] = (!empty($this->request->server[\"HTTP_REFERER\"]) && strpos($this->request->server[\"HTTP_REFERER\"], \"do_uninstall\")) ? $this->language->get(\'text_success_uninstall\') : $this->language->get(\'text_success\');]]></add>\n		</operation>\n      \n        <operation>\n			<search ><![CDATA[$json[\'error\'] = sprintf($this->language->get(\'error_exists\'), $modification_info[\'name\']);]]></search>\n			<add position=\"before\"><![CDATA[\n                          if (!empty($this->request->server[\'HTTP_REFERER\']) && strpos($this->request->server[\'HTTP_REFERER\'], \'do_uninstall\') !== false) {\n                              $this->model_extension_modification->deleteModification($modification_info[\'modification_id\']);\n                              $this->load->controller(\'extension/modification/refresh\');\n                              $this->response->addHeader(\'Content-Type: application/json\');\n                              $this->response->setOutput(json_encode($json));\n                              return;\n                          }\n			]]></add>\n		</operation>\n      \n		<operation>\n			<search><![CDATA[public function unzip() {]]></search>\n			<add position=\"before\"><![CDATA[	\n	public function do_uninstall() {\n        $this->index();\n    }\n\n	private function is_uninstall_request() {\n        return (!empty($this->request->server[\'HTTP_REFERER\']) && strpos($this->request->server[\'HTTP_REFERER\'], \'do_uninstall\') !== false);\n    }\n\n	private function rewrite_step($from, $to) {\n        return $this->is_uninstall_request() ? $to : $from;\n    }\n\n	private function remove_modifications() {\n		if(!empty($this->session->data[\'ext_uninstaller\'][\'modification_ids\'])) {\n			$this->load->model(\'extension/modification\');\n			foreach($this->session->data[\'ext_uninstaller\'][\'modification_ids\'] as $modification_id) {\n				$this->model_extension_modification->deleteModification($modification_id);\n			}\n		}\n\n		if(!empty($this->session->data[\'ext_uninstaller\'][\'modification_files\'])) {\n			foreach($this->session->data[\'ext_uninstaller\'][\'modification_files\'] as $file) {\n				unlink($file);\n			}\n		}\n	}\n\n	public function localremove() {\n		$this->load->language(\'extension/installer\');\n	\n		$this->remove_modifications();\n\n		$json = array();\n\n		if (!$this->user->hasPermission(\'modify\', \'extension/installer\')) {\n			$json[\'error\'] = $this->language->get(\'error_permission\');\n		}\n\n		if (VERSION == \'2.0.0.0\') {\n		    $directory = DIR_DOWNLOAD  . str_replace(array(\'../\', \'..\\\\\', \'..\'), \'\', $this->request->post[\'path\']) . \'/upload/\';\n		} else {\n		    $directory = DIR_UPLOAD  . str_replace(array(\'../\', \'..\\\\\', \'..\'), \'\', $this->request->post[\'path\']) . \'/upload/\';\n		}\n\n		if (!is_dir($directory)) {\n			$json[\'error\'] = $this->language->get(\'error_directory\');\n		}\n\n		if (!$json) {\n			// Get a list of files ready to upload\n			$files = array();\n\n			$path = array($directory . \'*\');\n\n			while (count($path) != 0) {\n				$next = array_shift($path);\n\n				foreach (glob($next) as $file) {\n					if (is_dir($file)) {\n						$path[] = $file . \'/*\';\n					}\n\n					$files[] = $file;\n				}\n			}\n\n			$root = dirname(DIR_APPLICATION).\'/\';\n\n			$dirs = array();\n\n			$GLOBALS[\'localremove.success\'] = false;\n			$this->load->controller(\'extension/modification/refresh\');\n			if (!$GLOBALS[\'localremove.success\']) {\n				$json[\'error\'] = $this->language->get(\'error_uninstaller_refresh\');\n			}\n\n			if (empty($json[\'error\'])) {\n              foreach ($files as $file) {\n                  // Upload everything in the upload directory\n                  $destination = substr($file, strlen($directory));\n\n                  // Update from newer OpenCart versions:\n                  if (substr($destination, 0, 5) == \'admin\') {\n                      $destination = DIR_APPLICATION . substr($destination, 5);\n                  } else if (substr($destination, 0, 7) == \'catalog\') {\n                      $destination = DIR_CATALOG . substr($destination, 7);\n                  } else if (substr($destination, 0, 5) == \'image\') {\n                      $destination = DIR_IMAGE . substr($destination, 5);\n                  } else if (substr($destination, 0, 6) == \'system\') {\n                      $destination = DIR_SYSTEM . substr($destination, 6);\n                  } else {\n                      $destination = $root.$destination;\n                  }\n\n                  if (is_dir($file)) {\n                      if (file_exists($destination)) {\n                          $dirs[] = $destination;\n                      }\n                  }\n\n                  if (is_file($file) && file_exists($destination)) {\n                      if (!unlink($destination)) {\n                          $json[\'error\'] = sprintf($this->language->get(\'error_unlink_file\'), $file);\n                      }\n                  }\n              }\n\n              foreach ($dirs as $dir) {\n                  $dh = opendir($dir);\n                  $is_dir_empty = true;\n                  while(false !== ($entry = readdir($dh))) {\n                      if ($entry != \'.\' && $entry != \'..\') {\n                          $is_dir_empty = false;\n                          break;\n                      }\n                  }\n                  closedir($dh);\n\n                  if ($is_dir_empty) {\n                      rmdir($dir);\n                  }\n              }\n			}\n		}\n\n		header(\'Content-Type: application/json\');\n		echo json_encode($json);\n		exit;\n	}]]></add>\n		</operation>\n	</file>\n  \n  	<file path=\"admin/controller/extension/installer.php\">\n		<operation error=\"skip\">\n			<search ><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/ftp\', \'token=\' . $this->session->data[\'token\'], \'SSL\')),]]></search>\n			<add position=\"replace\"><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/\'. $this->rewrite_step(\'ftp\', \'localremove\'), \'token=\' . $this->session->data[\'token\'], \'SSL\')),]]></add>\n		</operation>\n  	</file>\n\n  	<file path=\"admin/controller/extension/installer.php\">      \n		<operation error=\"skip\">\n			<search ><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/ftp\', \'token=\' . $this->session->data[\'token\'], true)),]]></search>\n			<add position=\"replace\"><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/\'. $this->rewrite_step(\'ftp\', \'localremove\'), \'token=\' . $this->session->data[\'token\'], true)),]]></add>\n		</operation>\n  	</file>\n\n  	<file path=\"admin/controller/extension/installer.php\">      \n      	<operation error=\"skip\">\n			<search ><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/localcopy\', \'token=\' . $this->session->data[\'token\'], \'SSL\')),]]></search>\n			<add position=\"replace\"><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/\'. $this->rewrite_step(\'localcopy\', \'localremove\'), \'token=\' . $this->session->data[\'token\'], \'SSL\')),]]></add>\n		</operation>\n  	</file>\n\n  	<file path=\"admin/controller/extension/installer.php\">     \n      	<operation error=\"skip\">\n			<search ><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/localcopy\', \'token=\' . $this->session->data[\'token\'], true)),]]></search>\n			<add position=\"replace\"><![CDATA[\'url\'  => str_replace(\'&amp;\', \'&\', $this->url->link(\'extension/installer/\'. $this->rewrite_step(\'localcopy\', \'localremove\'), \'token=\' . $this->session->data[\'token\'], true)),]]></add>\n		</operation>\n  	</file>\n  \n  	<file path=\"admin/controller/extension/modification.php\">\n		<operation>\n			<search ><![CDATA[$this->response->redirect]]></search>\n			<add position=\"before\"><![CDATA[\n				if (__FUNCTION__ == \'refresh\' && in_array($this->request->get[\'route\'], array(\"extension/installer/localremove\", \"extension/installer/xml\"))) {\n                    $GLOBALS[\'localremove.success\'] = true;\n					return;\n                }]]></add>\n		</operation>\n    </file>\n  \n  	<file path=\"admin/language/{english,en-gb}/extension/installer.php\">\n		<operation>\n			<search ><![CDATA[<?php]]></search>\n			<add position=\"after\"><![CDATA[\n// Uninstaller\n$_[\'error_unlink_file\'] = \'Failed to delete file %s\';\n$_[\'error_uninstaller_refresh\'] = \'Could not refresh the modifications!\';\n$_[\'entry_unlink\'] = \'Files that will be deleted\';\n$_[\'heading_title_uninstaller\'] = \'Extension Uninstaller\';\n$_[\'text_success_uninstall\'] = \'Success: You have uninstalled your extension!\';\n]]></add>\n		</operation>\n    </file>\n\n    <file path=\"admin/language/{russian,ru-ru}/extension/installer.php\">\n		<operation>\n			<search ><![CDATA[<?php]]></search>\n			<add position=\"after\"><![CDATA[\n// Uninstaller\n$_[\'error_unlink_file\'] = \'Невозможно удалить файл %s\';\n$_[\'error_uninstaller_refresh\'] = \'Не удалось обновить модификации!\';\n$_[\'entry_unlink\'] = \'Файлы, что будут удалены\';\n$_[\'heading_title_uninstaller\'] = \'Удаление модулей\';\n$_[\'text_success_uninstall\'] = \'Успешно: Вы удалили модуль!\';\n]]></add>\n		</operation>\n    </file>\n  \n  	<file path=\"admin/language/en-gb/common/column_left.php\">\n		<operation>\n			<search ><![CDATA[<?php]]></search>\n			<add position=\"after\"><![CDATA[\n// Uninstaller\n$_[\'heading_title_uninstaller\'] = \'Extension Uninstaller\';\n]]></add>\n		</operation>\n    </file>\n    <file path=\"admin/language/ru-ru/common/column_left.php\">\n		<operation>\n			<search ><![CDATA[<?php]]></search>\n			<add position=\"after\"><![CDATA[\n// Uninstaller\n$_[\'heading_title_uninstaller\'] = \'Удаление модулей\';\n]]></add>\n		</operation>\n    </file>\n\n    <file path=\"admin/controller/common/menu.php\">\n		<operation error=\"skip\">\n			<search ><![CDATA[$data[\'text_installer\'] = $this->language->get(\'text_installer\');]]></search>\n			<add position=\"after\"><![CDATA[		$data[\'text_uninstaller\'] = \'Удаление модулей\';]]></add>\n		</operation>\n    </file>\n      \n    <file path=\"admin/controller/common/menu.php\">\n 	     <operation error=\"skip\">\n			<search ><![CDATA[$data[\'installer\'] = $this->url->link(\'extension/installer\', \'token=\' . $this->session->data[\'token\'], \'SSL\');]]></search>\n			<add position=\"after\"><![CDATA[		$data[\'uninstaller\'] = $this->url->link(\'extension/installer/do_uninstall\', \'token=\' . $this->session->data[\'token\'], \'SSL\');]]></add>\n		</operation>\n    </file>\n      \n    <file path=\"admin/controller/common/column_left.php\">\n 	     <operation error=\"skip\">\n			<search ><![CDATA[if ($this->user->hasPermission(\'access\', \'extension/extension\')) {]]></search>\n            <add position=\"before\"><![CDATA[\n			if ($this->user->hasPermission(\'access\', \'extension/installer\')) {		\n				$extension[] = array(\n					\'name\'	   => $this->language->get(\'heading_title_uninstaller\'),\n                    \'href\'     => $this->url->link(\'extension/installer/do_uninstall\', \'token=\' . $this->session->data[\'token\'], true),\n					\'children\' => array()\n				);\n			}\n					\n            ]]></add>\n		</operation>\n    </file>\n      \n    <file path=\"admin/controller/common/menu.php\">\n 	     <operation error=\"skip\">\n			<search ><![CDATA[$data[\'installer\'] = $this->url->link(\'extension/installer\', \'token=\' . $this->session->data[\'token\'], true);]]></search>\n			<add position=\"after\"><![CDATA[		$data[\'uninstaller\'] = $this->url->link(\'extension/installer/do_uninstall\', \'token=\' . $this->session->data[\'token\'], true);]]></add>\n		</operation>\n    </file>\n  \n  	<file path=\"admin/view/template/common/menu.tpl\">\n		<operation>\n			<search ><![CDATA[<li><a href=\"<?php echo $installer; ?>\"><?php echo $text_installer; ?></a></li>]]></search>\n			<add position=\"after\"><![CDATA[<li><a href=\"<?php echo $uninstaller; ?>\"><?php echo $text_uninstaller; ?></a></li>]]></add>\n		</operation>\n    </file>\n</modification>', 1, '2020-09-04 19:08:40'),
(7, 'scc', 'css', 'test', '1.0', '', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>scc</name>\n    <code>css</code>\n    <version>1.0</version>\n    <author>test</author>\n    <link></link>\n    \n    <file path=\"catalog/view/theme/*/template/product/product.tpl\">\n    <operation>\n    <search><![CDATA[onclick=\"goBack()\"]]></search>\n    <add position=\"before\"><![CDATA[ style=\"display:none\" ]]>\n        </add>\n        </operation>\n    </file>\n</modification>', 1, '2020-09-04 19:46:34'),
(8, 'Add-links-to-admin-menu', 'imiw-add-links-to-admin-menu', 'ImakeITwork', '3.0', 'http://www.imakeitwork.net', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n    <name>Add-links-to-admin-menu</name>\r\n    <code>imiw-add-links-to-admin-menu</code>\r\n    <version>3.0</version>\r\n    <author>ImakeITwork</author>\r\n    <link>http://www.imakeitwork.net</link>\r\n\r\n	<file path=\"admin/controller/common/column_left.php\">\r\n		<operation>\r\n			<search><![CDATA[$catalog = array();]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n				$data[\'module_addLinksToAdminMenu_status\'] = $this->config->get(\'module_addLinksToAdminMenu_status\');\r\n				if ($data[\'module_addLinksToAdminMenu_status\']==1) {\r\n					$result = $this->db->query(\"SELECT * FROM `\" . DB_PREFIX . \"extension` WHERE `code` = \'addLinksToAdminMenu\'\");\r\n						if($result->num_rows) {\r\n							$custom_menu_links = $this->get_custom_menu_links();\r\n							if (!empty($custom_menu_links)) {\r\n								$data[\'menus\'][] = $custom_menu_links;\r\n							}																			\r\n						}\r\n				}\r\n	            ]]></add>\r\n		</operation>\r\n\r\n		<operation>\r\n			<search><![CDATA[public function index() { ]]></search>\r\n			<add position=\"before\"><![CDATA[\r\n	            public function get_custom_menu_links() {\r\n						$menu_title = $this->config->get(\'addlinksmenurename\');\r\n						$children = array();\r\n\r\n						$sess_token = $_REQUEST[\'token\']; \r\n\r\n						if (empty($menu_title)) $menu_title = \'Links\';\r\n\r\n							$query2 = $this->db->query(\"SHOW TABLES LIKE \'\" . DB_PREFIX . \"imiw_categories\' \");\r\n							$imiw_categories_exist = count($query2->rows);\r\n\r\n							if ($imiw_categories_exist==0) {\r\n								$this->db->query(\" CREATE TABLE IF NOT EXISTS \" . DB_PREFIX . \"imiw_categories (id int(11) AUTO_INCREMENT, category_title varchar(255), sort_order int(11), PRIMARY KEY (id) ) \");	\r\n							}\r\n\r\n							$query1 = $this->db->query(\"SHOW TABLES LIKE \'\" . DB_PREFIX . \"imiw_links\' \");\r\n							$imiw_links_exist = count($query1->rows);\r\n\r\n							if ($imiw_links_exist==0) {\r\n								$this->db->query(\" CREATE TABLE IF NOT EXISTS \" . DB_PREFIX . \"imiw_links (id int(11) AUTO_INCREMENT, link_title varchar(255), link_href varchar(255), new_window int(3), category_id int(11), sort_order int(11), PRIMARY KEY (id) ) \");	\r\n							}\r\n\r\n							$result3 = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"imiw_categories order by sort_order asc\");\r\n				\r\n							if (!empty($result3)) {\r\n								$categories = $result3->rows;\r\n										\r\n								if (count($categories)>0) {\r\n									foreach ($categories as $one_category) {\r\n\r\n										$cat_link = array();\r\n										$result5 = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"imiw_links where category_id=\".$one_category[\'id\'].\" order by sort_order asc\");\r\n\r\n										$category_links = $result5->rows;\r\n\r\n										if (!empty($category_links)) {\r\n															foreach ($category_links as $category_link) {\r\n\r\n											$temp_href = $category_link[\'link_href\'];\r\n											$custom_linkz_pos = strpos($temp_href, \'token=\');\r\n\r\n											if ($custom_linkz_pos === false) {	\r\n												$final_href = $temp_href;\r\n											} else {\r\n												$final_href = trim($temp_href).\'&token=\'.$sess_token;\r\n											}\r\n\r\n											if ($category_link[\'new_window\']==1) {\r\n												$cat_link[] = array(\r\n																		\'name\'	   => $category_link[\'link_title\'],\r\n																		\'href\'     => $final_href.\'\" target=\"_blank\',\r\n																		\'children\' => array()		\r\n												);\r\n											} else {\r\n												$cat_link[] = array(\r\n													\'name\'	   => $category_link[\'link_title\'],\r\n													\'href\'     => $final_href,\r\n													\'children\' => array()		\r\n												);\r\n											}\r\n																	\r\n										}															\r\n									}\r\n													\r\n									$children[] = array(\r\n										\'name\'	   => $one_category[\'category_title\'],\r\n										\'href\'     => \'\',\r\n										\'children\' => $cat_link\r\n									);\r\n								}\r\n							}\r\n						}\r\n\r\n						$result6 = $this->db->query(\"SELECT * FROM \" . DB_PREFIX . \"imiw_links where category_id<1 order by sort_order asc\");\r\n						$single_links = $result6->rows;\r\n\r\n\r\n									if (!empty($single_links)) {\r\n										foreach ($single_links as $one_link) {\r\n\r\n											$temp_href = $one_link[\'link_href\'];\r\n											$custom_linkz_pos = strpos($temp_href, \'token=\');\r\n\r\n											if ($custom_linkz_pos === false) {	\r\n												$final_href = $temp_href;\r\n											} else {\r\n												$final_href = trim($temp_href).\'&token=\'.$sess_token;\r\n											}\r\n\r\n											if ($one_link[\'new_window\']==1) {\r\n												$children[] = array(\r\n													\'name\'	   => $one_link[\'link_title\'],\r\n													\'href\'     => $final_href.\'\" target=\"_blank\',\r\n													\'children\' => array()		\r\n												);\r\n											} else {\r\n												$children[] = array(\r\n													\'name\'	   => $one_link[\'link_title\'],\r\n													\'href\'     => $final_href,\r\n													\'children\' => array()		\r\n												);\r\n											}\r\n										}\r\n									}\r\n\r\n									$menu = array(\r\n										\'id\'       => \'menu-links\',\r\n										\'icon\'	   => \'fa-link\',\r\n										\'name\'	   => $menu_title,\r\n										\'href\'     => \'\',\r\n										\'children\' => $children\r\n									);\r\n\r\n									return $menu;									\r\n								}\r\n	            ]]></add>\r\n		</operation>\r\n	</file>	\r\n	\r\n</modification>', 1, '2020-09-16 17:02:26'),
(9, 'Import export Combo', 'Import export Combo', 'WebX it solutions', '1.1', 'http://webxitsolutions.com', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<modification>\n	<name>Import export Combo</name>\n	<version>1.1</version>\n	<code>Import export Combo</code>\n	<author>WebX it solutions</author>\n	<link>http://webxitsolutions.com</link>\n	<file path=\"admin/view/template/common/menu.tpl\">\n		<operation>\n			<search><![CDATA[<li id=\"reports\"><a class=\"parent\"><i class=\"fa fa-bar-chart-o fa-fw\"></i> <span><?php echo $text_reports; ?></span></a>]]></search>\n			<add position=\"before\"><![CDATA[\n				<li id=\"excelpoint\"><a class=\"parent\"><i class=\"fa fa-file-excel-o\"></i> <span>Import Export Combo</span></a>\n					<ul>\n					  <li><a href=\"<?php echo $excel_import_port; ?>\">Import Point</a></li>\n					  <li><a href=\"<?php echo $excel_export_port; ?>\">Export Point</a></li>\n					 </ul>\n				</li>\n				]]></add>\n		</operation>		\n	</file>\n	<file path=\"admin/controller/common/menu.php\">\n		<operation>\n			<search><![CDATA[$data[\'upload\'] = $this->url->link(\'tool/upload\', \'token=\' . $this->session->data[\'token\'], true);]]></search>\n			<add position=\"before\"><![CDATA[\n				$data[\'excel_import_port\'] = $this->url->link(\'tool/excel_import\', \'token=\' . $this->session->data[\'token\'], true);\n				$data[\'excel_export_port\'] = $this->url->link(\'tool/excel_export\', \'token=\' . $this->session->data[\'token\'], true);\n				]]></add>\n		</operation>	\n	</file>\n	<file path=\"admin/controller/common/menu.php\">\n		<operation>\n			<search><![CDATA[$data[\'upload\'] = $this->url->link(\'tool/upload\', \'token=\' . $this->session->data[\'token\'], \'SSL\');]]></search>\n			<add position=\"before\"><![CDATA[\n				$data[\'excel_import_port\'] = $this->url->link(\'tool/excel_import\', \'token=\' . $this->session->data[\'token\'], \'SSL\');\n				$data[\'excel_export_port\'] = $this->url->link(\'tool/excel_export\', \'token=\' . $this->session->data[\'token\'], \'SSL\');\n				]]></add>\n		</operation>\n	</file>\n	<file path=\"admin/controller/common/column_left.php\">\n		<operation>\n			<search><![CDATA[$report = array();]]></search>\n			<add position=\"before\"><![CDATA[\n				$excel = array();\n			if ($this->user->hasPermission(\'access\', \'tool/excel_export\')) {		\n				$excel[] = array(\n					\'name\'	   => \'Import Point\',\n					\'href\'     => $this->url->link(\'tool/excel_import\', \'token=\' . $this->session->data[\'token\'], true),\n					\'children\' => array()		\n				);					\n			}\n			\n			if ($this->user->hasPermission(\'access\', \'tool/excel_export\')) {	\n				$excel[] = array(\n					\'name\'	   => \'Export Point\',\n					\'href\'     => $this->url->link(\'tool/excel_export\', \'token=\' . $this->session->data[\'token\'], true),\n					\'children\' => array()		\n				);			\n			}\n			\n			if ($excel) {	\n				$data[\'menus\'][] = array(\n					\'id\'       => \'excel-point\',\n					\'icon\'	   => \'fa-bar-chart-o fa-fw\', \n					\'name\'	   => \'Import Export Combo\',\n					\'href\'     => \'\',\n					\'children\' => $excel\n				);\n			}\n				]]></add>\n		</operation>\n	</file>\n</modification>', 1, '2020-09-16 17:46:41');
