(71, 1, 'Humanscale Footrest', '&lt;p&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Pre-Order lead time between 6 to 8 weeks&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;The FM100, offering a stable yet dynamically adjustable foot support, packs a lot of features into a value-priced package. In addition, the non-skid surface ensures that feet will stay right where you want them—on the foot rest—to relieve pressure on the lower back. &lt;span style=&quot;color:#000000;&quot;&gt;The FM100 footrest offers unprecedented comfort during extended sitting by encouraging gentle movement. This foot machine stimulates lower leg muscles and increases blood circulation by raising the feet and relieving pressure on the lower back. Thanks to its solid hardwood construction, powder-coated tubular frame and rubber pads, the FM100 foot machine provides uncompromising foot support that also encourages healthy circulation while the user is seated. Comfort isn’t a luxury–it’s a necessity. The FM100 offers superb performance and enhanced comfort for all users, in any environment.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 6 to 8 weeks upon comfirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 10 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&g