rong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Revolutionary counter-balance mechanism provides perfect recline resistance for all users–automatically&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Form-Sensing Mesh Technology features tri-panel, non-stretch mesh construction for body-hugging comfort&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Soft, low-abrasion mesh protects clothing while providing ultimate breathability&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Armrest options include armless, fixed arms or independently adjustable arms with a 125mm (5”) range&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Weight: 18.3kg (40.3 lbs)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Width: 675mm (26.5&quot;)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Base Width: 635mm (25&quot;)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Humanscale Liberty Chair', 'The Liberty Task chair is an intelligent mesh task chair engineered to provide automatic lumbar support for every user, as well offering simplicity and complete ease of use. Liberty was designed to offer a unique, minimal aesthetic and to provide custom c', 'The Liberty Task chair is an intelligent mesh task chair engineered to provide automatic lumbar support for every user, as well offering simplicity and complete ease of use. Liberty was designed to offer a unique, minimal aesthetic and to provide custom c'),
(78, 1, 'Humanscale M2.1 Monitor Arm', '&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Stock &lt;/b&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Available&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Use your coupon code upon checkout for further discount!&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;youtube-embed-wrapper&quot; style=&quot;position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden;&quot;&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;//www.youtube.com/embed/gUTG0nh44XY&quot; style=&quot;position: absolute;top: 0;left: 0;width: 100%;height: 100%;&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/div&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;In today’s fast-paced, agile work environment, there’s no time for discomfort. M2.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks and sit/stand workstations alike, M2.1 meets a variety of configuration needs for lighter monitors up to 7 kg (15.5 lbs.).&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Stock Available&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 15 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M21 M2.1 Monitor Arm&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;CM - Two-Piece Clamp Mount with Base&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W - Polished Aluminium with White Trim&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;B - Angled Link/Dynamic Link&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;T - Standard Monitor Tilt (one per monitor)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;B - Standard 100mm x 100mm, black&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Weight Capacity:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Standard Single or Dual Monitors 2 - 7 kg (5-15.5 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Height Adjustment Range: Up to 305 mm (12&quot;)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Colour Options:&lt;br /&gt;\r\n• Polished Aluminium with White Trim&lt;br /&gt;\r\n• Silver with Grey Trim&lt;br /&gt;\r\n• Black with Black Trim&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Allows user to view their monitor(s) at an optimal position&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Rubberized Cable Management makes it simple to run cords through a modular system for a clean, sleek and organised aesthetic&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- A patented, weight-compensating spring technology enables smooth and uniform height adjustment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Built-in Counterbalance Indicator provides the ability to counterbalance the monitor weight before monitor installation to reduce expensive computer setup costs&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Patent-pending Smart Stop allows the user to customise the rotation of the arm, preventing overhang and protecting surrounding equipment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Patent-pending Quick Release Joints instantly snap together for a secure and robust fit, simplifying installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Only one tool is required, and it’s neatly concealed inside the arm base&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Can be configured to hold up to three monitors&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Compatible with M/Connect 2 and M/Power, the first-ever integrated monitor arm bases and docking stations of their kind&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Humanscale M2.1 Monitor Arm', 'n today’s fast-paced, agile work environment, there’s no time for discomfort. M2.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks', 'n today’s fast-paced, agile work environment, there’s no time for discomfort. M2.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks'),
(79, 1, 'Humanscale M8.1 Cross Bar Monitor Arm', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;Stocks Available&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;strong&gt;Use your coupon code upon checkout for further discount!&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;In today’s fast-paced, agile work environment, there’s no time for discomfort. M8.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks and sit/stand workstations alike, M8.1 meets a variety of configuration needs for single monitors from 3 - 13 kg (6 - 28 lbs.) or – with an optional crossbar support – dual monitors up to 5.5 kg (12 lbs.) each. Featuring innovations like Humanscale’s patented Weight-Compensating Spring Technology and Smart Stop functionality, M8.1 enables the personalisation and flexibility needed for today’s evolving workplaces.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Stock Available&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 15 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M81 M8.1 Monitor Arm&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;CM - Two-Piece Clamp Mount with Base&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W - Polished Aluminium with White Trim&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;B - Angled Link/Dynamic Link&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;H - Crossbar for 2 monitors, with Handle&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;B - Standard 100mm x 100mm, black&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;b&gt;Specifications:&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Weight Capacity:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Heavy Single or Dual Monitors 3 - 13 kg (6-28 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Height Adjustment Range: Up to 305 mm (12&quot;)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Colour Options:&lt;br /&gt;\r\n• Polished Aluminium with White Trim&lt;br /&gt;\r\n• Silver with Grey Trim&lt;br /&gt;\r\n• Black with Black Trim&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Allows user to view their monitor(s) at an optimal position&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Rubberized Cable Management makes it simple to run cords through a modular system for a clean, sleek and organised aesthetic&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- A patented, weight-compensating spring technology enables smooth and uniform height adjustment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Built-in Counterbalance Indicator provides the ability to counterbalance the monitor weight before monitor installation to reduce expensive computer setup costs&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Patent-pending Smart Stop allows the user to customise the rotation of the arm, preventing overhang and protecting surrounding equipment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Patent-pending Quick Release Joints instantly snap together for a secure and robust fit, simplifying installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Only one tool is required, and it’s neatly concealed inside the arm base&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Can be configured to hold up to three monitors&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Compatible with M/Connect 2 and M/Power, the first-ever integrated monitor arm bases and docking stations of their kind&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Humanscale M8.1 Cross Bar Monitor Arm', 'In today’s fast-paced, agile work environment, there’s no time for discomfort. M8.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks', 'In today’s fast-paced, agile work environment, there’s no time for discomfort. M8.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks'),
(80, 1, 'Humanscale QuickStand Classic Dual', '&lt;p&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Stock Available&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Use your coupon code upon checkout for further discount!&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Voted the best office accessory of the decade (Best in 10) at Interior Design magazine\'s 2015 Best of Year Awards, the QuickStand height-adjustable workstation raises the bar for ease of use and stability among sit/stand products. QuickStand seamlessly transforms any fixed-height desk into an active one, promoting collaboration and well-being in the workplace. With weightless operation and a plug-and-play cable management system, QuickStand neatly attaches to the back of any work surface, placing the screen and keyboard in an ergonomically correct position for the user.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Stock Available&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 5 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;QS Quickstand&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W - White&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;C - Standard Crossbar (Two screens up to 13.6kg/30lbs. total / 24&quot; wide)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;30 - Large platform&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;F - Freestanding Base&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;N - No Cables&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;N - No Cables&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications&lt;/strong&gt;:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Two USB 2.0 outlets for keyboard/mouse&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 460mm (18”) of height adjustment plus an additional 5”(127 mm) of single/dual monitor display adjustment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Cable harnesses are offered with four technology platforms: VGA, HDMI, DisplayPort, and DVI-D&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Available in three mount options:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;u&gt;Freestanding base &lt;/u&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;•Small worksurface: Width 28” (712mm), Depth 17.5” (445mm)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Large work surface: Width 28” (712mm) Depth 28.5” (724mm)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;u&gt;Clamp&lt;/u&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Can be adjusted to fit desks with a depth of 610 - 762 mm (24–30”) and a thickness of 70mm (2.75”)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;u&gt;Bolt-through Grommet&lt;/u&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Total product weight:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;*Freestanding base: 34kg (75 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;*Other bases: 25.4 - 26.3 kg (56–58 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- QuickStand can hold the following weights*:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Heavy mount (single monitor): 13.6kg (30 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Light mount (single monitor): 5kg (11 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Heavy mount with crossbar (for two monitors): 13.6kg (30 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Adaptable to any fixed-height work surface&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Adjustable keyboard platform enables user to raise or lower work surface to desired height&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Provides ultimate stability while typing&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Available in single and dual monitor configurations and can support monitors up to 13.6kg (30lbs)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Fully integrated cable management system&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Delivered with easy-to-install, pre-lengthened cables that are designed for durability and regular movement&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Humanscale QuickStand Classic Dual', 'Voted the best office accessory of the decade (Best in 10) at Interior Design magazine\'s 2015 Best of Year Awards, the QuickStand height-adjustable workstation raises the bar for ease of use and stability among sit/stand products. QuickStand seamlessly tr', 'Voted the best office accessory of the decade (Best in 10) at Interior Design magazine\'s 2015 Best of Year Awards, the QuickStand height-adjustable workstation raises the bar for ease of use and stability among sit/stand products. QuickStand seamlessly tr');
INSERT INTO `datumstruct_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(81, 1, 'Humanscale Quickstand Eco, Dual Monitor', '&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Stocks Available&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Use your coupon code upon checkout for further discount!&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Humanscale’s QuickStand Eco is the next generation in portable sit/stand products. Sleeker, easier to use and comprised of more sustainable materials than ever before, it is a vast improvement over the current generation of sit/stand options. This work surface is available in laptop, single or dual monitor configurations. QuickStand Eco features simple setup, portability and near effortless adjustability – transforming ordinary desktops into healthy, active workspaces.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Stock Available&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 5 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;QSE – QuickStand Eco&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W - White&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;D - Dual Monitor&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Main assembly holds up to 15.9kg (35 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Designed to accommodate users of varying heights with 472mm (18.6”) of work surface adjustment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Effortless functionality encourages more movement and allows user to move from sitting to standing instantly&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Minimal footprint allows for more use of the desktop area&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Self-locking mechanism provides ultimate stability and functionality&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Affordable workspace wellness solution that will blend into any environment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Compatible with OfficeIQ — Humanscale’s innovative sit/stand alert software&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Monitor height adjustment for correct ergonomic fit&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Work Surface: 711mm W x 483mm D (28” W x 19” D)&lt;/span&gt;&