h a mi', 'Float is a revolutionary standing office desk that brings effortless operation to traditional sit-stand products. Ease of use is at the heart of Float, as it seamlessly adjusts between sitting and standing postures without interrupting workflow. With a mi'),
(148, 1, '(HS) M2.1 Monitor Arm', '&lt;p&gt;In today’s fast-paced, agile work environment, there’s no time for discomfort. M2.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks and sit/stand workstations alike, M2.1 meets a variety of configuration needs for lighter monitors up to 7 kg (15.5 lbs.).&lt;/p&gt;\r\n\r\n&lt;p&gt;In today’s fast-paced, agile work environment, there’s no time for discomfort. M2.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks and sit/stand workstations alike, M2.1 meets a variety of configuration needs for lighter monitors up to 7 kg (15.5 lbs.).&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Specification :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;M21 M2.1 Monitor Arm&lt;/p&gt;\r\n\r\n&lt;p&gt;CM - Two-Piece Clamp Mount with Base&lt;/p&gt;\r\n\r\n&lt;p&gt;W - Polished Aluminium with White Trim&lt;/p&gt;\r\n\r\n&lt;p&gt;B - Angled Link/Dynamic Link&lt;/p&gt;\r\n\r\n&lt;p&gt;T - Standard Monitor Tilt (one per monitor)&lt;/p&gt;\r\n\r\n&lt;p&gt;B - Standard 100mm x 100mm, black&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;No additional charges for delivery &amp; installation.&lt;/p&gt;', '', 'M2.1 Monitor Arm', '', ''),
(149, 1, '(HS) M8.1 Cross Bar Monitor Arm', '&lt;p&gt;In today’s fast-paced, agile work environment, there’s no time for discomfort. M8.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks and sit/stand workstations alike, M8.1 meets a variety of configuration needs for single monitors from 3 - 13 kg (6 - 28 lbs.) or – with an optional crossbar support – dual monitors up to 5.5 kg (12 lbs.) each. Featuring innovations like Humanscale’s patented Weight-Compensating Spring Technology and Smart Stop functionality, M8.1 enables the personalisation and flexibility needed for today’s evolving workplaces.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Specification :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;M81 M8.1 Monitor Arm&lt;/p&gt;\r\n\r\n&lt;p&gt;CM - Two-Piece Clamp Mount with Base&lt;/p&gt;\r\n\r\n&lt;p&gt;W - Polished Aluminium with White Trim&lt;/p&gt;\r\n\r\n&lt;p&gt;B - Angled Link/Dynamic Link&lt;/p&gt;\r\n\r\n&lt;p&gt;H - Crossbar for 2 monitors, with Handle&lt;/p&gt;\r\n\r\n&lt;p&gt;B - Standard 100mm x 100mm, black&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;No additional charges for delivery &amp; installation.&lt;/p&gt;', '', 'M8.1 Cross Bar Monitor Arm', '', ''),
(151, 1, 'Framery O', '&lt;p&gt;Framery O is ideal for important calls or video conferences. Have your discussions in privacy without disturbing your colleagues. The pioneering office phone booth delivers an echo-free and comfortable working environment. Installation is fast and the pod is ready to be used the same day it’s delivered.&lt;/p&gt;\r\n\r\n&lt;p&gt;Happiness is the reason why Framery exists and is at the heart of everything we do. Our silent pods transform open-plan office behavior, enabling people to be more efficient and happier. Today over 40% of Forbes top 100 companies have happier workplaces because of Framery pods, and the number is growing fast.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Call us now for an appointment!&lt;/p&gt;', '', 'Framery O', 'Framery O is ideal for important calls or video conferences. Have your discussions in privacy without disturbing your colleagues. The pioneering office phone booth delivers an echo-free and comfortable working environment. Installation is fast and the pod', 'Framery O Single Phone Booth Pod Happiness Office Quiet Secluded Concentration Popular Worldwide Silent Privacy Collaboration Modern Design Designer Workplace'),
(152, 1, 'Framery Q - Meeting Maggie', '&lt;p&gt;The Framery Q office pod is a perfect, soundproof place for people to have meetings, brainstorming sessions and important one-on-one conversations in private without disturbing the whole office – or the office disturbing you.&lt;/p&gt;\r\n\r\n&lt;p&gt;Meeting Maggie is suitable for meetings, brainstorming and much more. Choose from three different table options – two Maggie Sofas are always included. Meeting Maggie comes with pleasant LED lighting and three power sockets.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Call us now for an appointment!&lt;/p&gt;', '', 'Framery Q Meeting Maggie', 'The Framery Q office pod is a perfect, soundproof place for people to have meetings, brainstorming sessions and important one-on-one conversations in private without disturbing the whole office – or the office disturbing you.\r\n\r\nMeeting Maggie is suitable', 'Framery Q Meeting Magie Happiness Pod Phone Booth Privacy Quiet Space Company Workplace office Double Single Lounge Modern Design Living Designer Living expat recommended popular worldwide top best good quality ventilation quality good top'),
