p;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#565758&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Acoustic Panel - Still T', 'With Yeseco Still T you can make wall size image prints.\r\n\r\nStill T is 45 mm thick and comes with image print on natural surface. The maximum size of a single panel is 1200×800 mm. Larger images are made of several pieces, which are installed by gluing th', ''),
(158, 1, 'Framery 2Q - Lounge', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;The 2Q Lounge variation provides a more casual environment for company meetings, a calm space to retreat to during the work day, or an area for socialization. Custom-designed Clint Sofa, large whiteboard, free-standing Piaggio table and a wall shelf make up for a functional yet relaxed setting. Additional options include a display bracket on the wall for a TV or a booking system ready option for the door.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Call us now for an appointment!&lt;/span&gt;&lt;/p&gt;', '', 'Framery Q - 2Q Lounge', 'The 2Q Lounge variation provides a more casual environment for company meetings, a calm space to retreat to during the work day, or an area for socialization. Custom-designed Clint Sofa, large whiteboard, free-standing Piaggio table and a wall shelf make', 'Framery 2Q Lounge Happiness Pod Phone Booth Privacy Quiet Space Company Workplace office Double Single Lounge Modern Design Living Designer expat recommended popular worldwide top best good quality ventilation quality good top'),
(160, 1, 'Framery Q - Working With PAL', '&lt;p&gt;Working with PAL&lt;/p&gt;\r\n\r\n&lt;p&gt;A high table and handy bar stools make this decor option very efficient for short-term sessions. The shape of the desk is suitable for teamwork for two, private sessions or video and tele conferences. Working with PAL comes with pleasant LED lighting, three power sockets and stylish coat hangers.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Call us now for an appointment!&lt;/p&gt;', '', 'Framery Q Working With PAL', 'Working with PAL\r\n\r\nA high table and handy bar stools make this decor option very efficient for short-term sessions. The shape of the desk is suitable for teamwork for two, private sessions or video and tele conferences. Working with PAL comes with pleasa', 'Framery Q Working with  PAL Happiness Pod Phone Booth Privacy Quiet Space Company Workplace office Double Single Lounge Modern Design Living Designer Living expat recommended popular worldwide top best good quality ventilation quality good top'),
(161, 1, 'Framery O - Quick Call', '&lt;p&gt;Looking for a small office phone booth for important phone calls? Or maybe a meeting pod for efficient team work? Framery O Quick Call allows you to design yours to suit your needs from a wide range of useful accessories, fashionable colors and comfortable seating options. Choose what you like and we’ll make it happen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Quality materials deliver on the acoustic promises. A combination of sustainably sourced materials, patented technology and signature design creates an award winning result. So, no matter how noisy the office, you always have a place to concentrate.&lt;/p&gt;\r\n\r\n&lt;p&gt;Call us now for an appointment!&lt;/p&gt;', 'Framery O', 'Framery O - Quick Call', 'Looking for a small office phone booth for important phone calls? Or maybe a meeting pod for efficient team work? Framery O Quick Call allows you to design yours to suit your needs from a wide range of useful accessories, fashionable colors and comfortabl', 'Framery O Quick Call Single Phone Booth Pod Happiness Office Quiet Secluded Concentration Popular Worldwide Silent Privacy Collaboration Modern Design Designer Workplace Office'),
(165, 1, 'Workstation - Work Pod - 1', '&lt;p&gt;&lt;span style=&quot;background:#f8f8f8&quot;&gt;&lt;span style=&quot;line-height:17.35pt&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:13.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#393939&quot;&gt;&lt;span style=&quot;text-transform:uppercase&quot;&gt;&lt;span style=&quot;letter-spacing:.75pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height:17.35pt&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:13.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#393939&quot;&gt;&lt;span style=&quot;text-transform:uppercase&quot;&gt;&lt;span style=&quot;letter-spacing:.75pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;small&gt;&lt;cite&gt;Modular pod  are perfect for holding meetings, brainstorming sessions to grow any business. A collection of flexible workspaces that screen you from sight and sound. Designed with a softer aesthetic and the ability to be customised, the collection consists of work pods and lounge pods. &lt;/cite&gt;&lt;/small&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;small&gt;&lt;cite&gt;Work pods provides spaces for individuals and groups to step into a quiet space, creating private workspaces without compromising your open office ideal. It not only has a series of standard panels that combine to create a multitude of configurations, it can be customised with different fabric to enhance the look. &lt;/cite&gt;&lt;/small&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;cite&gt;&lt;img alt=&quot;Modular Work Pods&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Workstation - Work Pods/Onlead/13.jpg&quot; style=&quot;width: 500px; height: 317px;&quot; /&gt;&lt;/cite&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom:.0001pt&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:10.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#565758&quot;&gt;&lt;a href=&quot;https://yeseco.fi/wp-content/uploads/2017/05/paivakodit-ja-koulut-yeseco-1-1.jpg&quot; target=&quot;_self&quot;&gt;&lt;span style=&quot;border:none windowtext 1.0pt; font-size:12.0pt; padding:0cm&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Times New Roman&amp;quot;,serif&quot;&gt;&lt;span style=&quot;color:#323232&quot;&gt;&lt;span style=&quot;text-decoration:none&quot;&gt;&lt;span style=&quot;text-underline:none&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/a&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:10.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#565758&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Work Pods - 1', '', ''),
(166, 1, 'Framery 2Q - Standard', '&lt;p&gt;Framery 2Q meeting booth is designed for 4-6 people. It’s the best place to co-create, brainstorm and have meetings. Our superior sound insulation system ensures that your meetings won’t disturb the office – and the office noise won’t disturb you.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Call us now for an appointment!&lt;/p&gt;', '', 'Framery Q - 2Q Standard', 'Framery 2Q meeting booth is designed for 4-6 people. It’s the best place to co-create, brainstorm and have meetings. Our superior sound insulation system ensures that your meetings won’t disturb the office – and the office noise won’t disturb you.', 'Framery 2Q Standard Collaboration Happiness Pod Phone Booth Privacy Quiet Space Company Workplace office Double Single Lounge Modern Design Living Designer Living expat recommended popular worldwide top best good quality ventilation quality good top');
INSERT INTO `datumstruct_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(167, 1, 'Framery O - Video Conferencing Ready', '&lt;p&gt;Framery O is available in the Video Conference Ready variant. A tilting screen bracket and the LED lighting surrounding the screen provide optimal conditions for video conferences, with the control panel enabling you to adjust the lighting and airflow inside the pod.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Call us now for an appointment!&lt;/p&gt;', '', 'Framery O - Video Conferencing Ready', 'Framery O is available in the Video Conference Ready variant. A tilting screen bracket and the LED lighting surrounding the screen provide optimal conditions for video conferences, with the control panel enabling you to adjust the lighting and airflow ins', 'Framery O Video Conferencing Ready Single Phone Booth Pod Happiness Office Quiet Secluded Concentration Popular Worldwide Silent Privacy Collaboration Modern Design Designer Workplace Office'),
(168, 1, 'Humanscale Horizon LED Task Light', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;strong&gt;Pre-Order lead time between 6 to 8 weeks&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;The most celebrated and beautiful table light in the industry, Horizon is a visually striking embodiment of Humanscale’s commitment to high performance and functionality. Recipient of the prestigious Red Dot Awardas well as a Next Generation Luminaires Award for product design and performance, Horizon resides in the permanent collection of the Museum of Modern Art (MoMA)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 6 to 8 weeks upon comfirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 10 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;HNB - Horizon Light with Desktop Base &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;U - Universal Plug &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W - White&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;spa