(169, 1, 'Humansale Keyboard (without Clip Mouse)', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;strong&gt;Pre-Order lead time between 6 to 8 weeks&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;b&gt;Use your coupon code upon checkout for further discount!&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;In many ways, a keyboard support is the heart of an ergonomic workstation. As reach and vision drive posture, an articulating keyboard system allows the user to sit in a healthy, neutral posture through bringing the keyboard and mouse to the user. A well-designed articulating keyboard system offers protection from carpal tunnel syndrome, neck and back pain and other musculoskeletal issues. Since 1999, Humanscale has been the leading manufacturer of articulating keyboard systems and today sells more than all other manufacturers combined.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;-  6 - 8 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 15 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;6FW