(172, 1, 'Workstation - Storage', '&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;cite&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-style:normal&quot;&gt;Get organized with our versatile office furnishing while maintaining the timeless look. &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;line-height:150%&quot;&gt;Transform your living and working spaces with furniture customized to your unique needs. The office is like a second home to many employees where new business opportunities are generated and being tested. &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/cite&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;cite&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;On top of adding beautifully furnished office accessories, balancing between practicality and comfort is important for employees.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/cite&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom:7.5pt&quot;&gt; &lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom:7.5pt&quot;&gt;&lt;strong&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:19.2pt&quot;&gt;Contact our sales team now to find out more!&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom:7.5pt&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:19.2pt&quot;&gt;We are happy to assist. Call us 6546 9874 for our team to provide professional consultation, design and space planning.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom:7.5pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:19.2pt&quot;&gt;&lt;span style=&quot;font-size:10.5pt&quot;&gt;&lt;span style=&quot;font-family:Poppins&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Workstation - Storage', '', ''),
(173, 1, 'Training Tables', '&lt;p&gt;Customised your training room with different tables available.&lt;/p&gt;\r\n\r\n&lt;p&gt;From theater to class room settings, we have everything that you need to have for the most idea training environment!&lt;/p&gt;\r\n\r\n&lt;p&gt;Call us now for a transformation!&lt;/p&gt;', '', 'Training Tables', '', ''),
(174, 1, 'Humanscale QuickStand Eco, Laptop', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;strong&gt;Pre-Order lead time between 6 to 8 weeks&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Humanscale’s QuickStand Eco is the next generation in portable sit/stand products. Sleeker, easier to use and comprised of more sustainable materials than ever before, it is a vast improvement over the current generation of sit/stand options. This work surface is available in laptop, single or dual monitor configurations. QuickStand Eco features simple setup, portability and near effortless adjustability – transforming ordinary desktops into healthy, active workspaces.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 6 - 8 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 5 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;QSE - QuickStand Eco&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W - White&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;L- Laptop workstation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span st