(202, 1, 'Workstation - Executive Work Stations', '&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;Minimalist design can be identified by a framework that’s is simple in nature, and that only the necessary elements for functionality are included. Thus, shifting the paradigm of traditional work spaces they\'d been planned with permanent layouts to minimalist design whereby it is so simple that users don\'t even think of it whiles working. This shift moves beautifully in tandem with the notion about encouraging workers to come together regularly, hoping it spur fresh ideas and innovation.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;Desk arrangements not only helps with organizing your work-related matters, it increases productivity of every individual staff as it gives them more room to work!&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;1-1F40G00I6&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Workstation - Work Pods/Onlead/zen pro.png&quot; style=&quot;margin-left: 0px; margin-right: 0px; width: 500px; height: 230px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;A table for 8!&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;CLUSTER OF 8 _SF2_ PERSPECTIVE _2_&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Workstations/2 - Workstation/CLUSTER OF 8 _SF2_ PERSPECTIVE _2_.jpg&quot; style=&quot;width: 500px; height: 367px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;A full functional table can be as simple as 3 components!&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Desk System&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Workstation - Work Pods/Onlead/Desk System.png&quot; style=&quot;width: 500px; height: 375px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Desk that is suitable for all level within the organization!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Concept Page&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Workstation - Work Pods/Onlead/Concept Page.png&quot; style=&quot;width: 500px; height: 255px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Strike a balance at work. Create a comfortable cosy area which makes your office feels like home!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;20190103164842_6268&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Workstation - Work Pods/20190103164842_6268.jpg&quot; style=&quot;width: 500px; height: 333px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Specifications :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please contact us at 6546 9874 for more details.&lt;/p&gt;', '', 'Workstation - Executive Work Stations', '', '');
