(208, 1, '(HS) M/Connect', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;The M/Connect USB 3.0, dual-video docking station is a unique innovation that merges ergonomics and technology. Available with Humanscale’s &lt;/span&gt;&lt;a href=&quot;https://www.humanscale.com/products/product.cfm?group=M2&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M2&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;color:#000000;&quot;&gt;, &lt;/span&gt;&lt;a href=&quot;https://www.humanscale.com/products/product.cfm?group=m8&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M8&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;color:#000000;&quot;&gt;, and &lt;/span&gt;&lt;a href=&quot;https://www.humanscale.com/products/product.cfm?group=mflex&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M/Flex&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;color:#000000;&quot;&gt; &lt;/span&gt;&lt;a href=&quot;https://www.humanscale.com/products/category_detail.cfm?category=monitorarms&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;monitor arms&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;color:#000000;&quot;&gt;, M/Connect gives easy access to user ports and conceals IT ports to eliminate cable clutter. M/Connect is a total workspace solution that enhances the computing experience.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 6 - 8 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 5 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specification :&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;CR - M/Connect Retrofit&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;2 - M2 Arm&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W - Polished Aluminium with White Trim&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;NA - North America&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - No additional Cable Covers&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', '(HS) MConnect', '', ''),
(209, 1, 'Humanscale Foot Rocker FR500', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Pre-Order lead time between 6 to 8 weeks&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;The award-winning FR500 delivers effortless functionality in a simple, stylish package. Like all Humanscale Foot Rockers, the FR500 promotes health and comfort by getting the user’s feet moving. This addition to the workstation provides instant relief from prolonged sitting by encouraging a gentle rocking of the feet. The FR500 Foot Rockers provides perfect support for the feet and legs when sitting. By engaging lower leg muscles, it increases healthful circulation while also raising the feet to relieve pressure on the lower back.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 6 - 8 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;FR500 - Foot Rocker 500&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Die-cast aluminium legs&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Molded plywood platform&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Steel foot stop&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Rubber grips&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Dimensions: 425mm (16.75”) W x 310mm (12.25”) D x 115mm (4.5”) H&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Curved leg design encourages rocking motion&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Provides support for lower back&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Rubber, non-skid grips keep feet in place and protect hard flooring&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 99% recyclable&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Humanscale Foot Rocker FR500', 'The award-winning FR500 delivers effortless functionality in a simple, stylish package. Like all Humanscale Foot Rockers, the FR500 promotes health and comfort by getting the user’s feet moving. This addition to the workstation provides instant relief fro', 'The award-winning FR500 delivers effortless functionality in a simple, stylish package. Like all Humanscale Foot Rockers, the FR500 promotes health and comfort by getting the user’s feet moving. This addition to the workstation provides instant relief fro'),
(210, 1, 'Humanscale MFlex', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M/Flex for M2.1, M8.1, and M10&lt;br /&gt;\r\nM/Flex transforms any workspace with unprecedented flexibility and ergonomic performance. Designed for today’s agile work environment, users can easily add or remove monitors without disrupting the originally configured installation. This multi-monitor arm system accommodates endless configurations and is fully compatible with Humanscale’s next generation monitor arms — providing all of the cutting-edge features of the line. Easy to install and simple to upgrade for an overall reduced cost of ownership, M/Flex is the most scalable solution available for the modern workplace.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;“ We had to create a solution that’s essentially future-proof—one that’s ready to support today’s technology and the technology of the future.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 6 - 8 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 15 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Weight Capacity: Supports up to 40 kg (90 lbs.) &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Maximum Arm Reach: Up to 710 mm (28”) &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Maximum Height Adjustment: Up to 255 mm (10”) dynamic 760 mm (30”) static &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Monitor Capacity: Up to 6 monitors &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Colour Options: &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Polished Aluminium with White Trim &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Silver with Grey Trim &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;• Black with Black Trim &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Product Material: Recycled Aluminium&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Scalable solution accommodates future additions of up to 6 monitors &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Compatible with Humanscale’s M2.1, M8.1 and M10 monitor arms &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Reduces future installation costs by allowing for simple reconfigurations &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Available with accessories such as Notebook Holders, Crossbars, Thin Client Holders, UFEAs, Coloured VESA Covers and Sliders &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Patent-pending Smart Stop allows the user to customise the rotation of the arm, preventing overhang and protecting surrounding equipment &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Patent-pending Quick Release Joints instantly snap together for a secure and robust fit, simplifying installation &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Compatible with M/Connect, M/Connect 2 and M/Power, the first-ever integrated monitor arm bases and docking stations of their kind&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Humanscale MFlex', 'M/Flex for M2.1, M8.1, and M10\r\nM/Flex transforms any workspace with unprecedented flexibility and ergonomic performance. Designed for today’s agile work environment, users can easily add or remove monitors without disrupting the originally configured ins', ''),
