(229, 1, 'Workstation - Conference/Meeting Table', '&lt;p&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family:Verdana,Geneva,sans-serif;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:19.2pt&quot;&gt;&lt;cite&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-style:normal&quot;&gt;Minimalist design can be identified by a framework that’s is simple in nature, and that only the necessary elements for functionality are included. Thus, shifting the paradigm of traditional workspaces they\'d been planned with permanent layouts to minimalist design whereby it is so simple that users don\'t even think of it whiles working. This shift moves beautifully in tandem with the notion about encouraging workers to come together regularly, hoping it spur fresh ideas and innovation.&lt;/span&gt;&lt;/span&gt;&lt;/cite&gt;&lt;cite&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-style:normal&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/cite&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom:7.5pt&quot;&gt; &lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom:7.5pt&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;font-family:Verdana,Geneva,sans-serif;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:19.2pt&quot;&gt;Contact our sales team now to find out more!&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-bottom:7.5pt&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:19.2pt&quot;&gt;&lt;span style=&quot;font-family:Verdana,Geneva,sans-serif;&quot;&gt;We are happy to assist. Call us 6546 9874 for our team to provide professional consultation, design and space planning.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Workstation - Conference Table', '', ''),
