(236, 1, 'Workstation - Height Adjustable Table - Triple', '&lt;p&gt;Classic design with expandable frame to fit in various workspace!&lt;/p&gt;\r\n\r\n&lt;p&gt;Pesk is a popular desk model with classic design. It\'s industrial design aims specifically at feasibility and simplicity.&lt;/p&gt;\r\n\r\n&lt;p&gt;PESK is a perfect match for firstime standing desk users, dynamic workspace especially co-working spaces, startups and standard office.&lt;br /&gt;\r\n &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Specifications :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please contact us at 6546 9874 for more details.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;No additional charges for delivery and installation.&lt;/p&gt;', '', 'H.A.T-Height Adjustable Table', '', ''),
(237, 1, 'Cable Management', '&lt;p&gt;With our modern offices throughout the world, we are equipped with wealth of expertise in modular wiring and power solutions for commercial buildings.&lt;/p&gt;\r\n\r\n&lt;p&gt;We supply a broad range of off-the-shelf and bespoke desk ergonomics products to many of the most popular desking manufacturers, providing great value solutions, to help them succeed in a competitive sector, which still demands quality.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Specifications :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please contact us at 6546 9874 for more details.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;No additional charges for delivery and installation.&lt;/p&gt;', '', 'Cable Management', '', ''),
(238, 1, 'Ilmava Table Screen', '&lt;p&gt;&lt;span style=&quot;background:#f8f8f8&quot;&gt;&lt;span style=&quot;line-height:17.35pt&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:13.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#393939&quot;&gt;&lt;span style=&quot;text-transform:uppercase&quot;&gt;&lt;span style=&quot;letter-spacing:.75pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height:17.35pt&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:13.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#393939&quot;&gt;&lt;span style=&quot;text-transform:uppercase&quot;&gt;&lt;span style=&quot;letter-spacing:.75pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;background:#f8f8f8&quot;&gt;&lt;span style=&quot;line-height:17.35pt&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:13.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#393939&quot;&gt;&lt;span style=&quot;text-transform:uppercase&quot;&gt;&lt;span style=&quot;letter-spacing:.75pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;h5&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;ILMAVA TABLE SCREEN&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h5&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;b&gt;Use your promotion code upon checkout for further discount!&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;The basic idea of the Ilmava product is the fabric finish on both sides of the panel and a thinned and finished edge. Thus Ilmava products can be visually mounted on a central location of a room.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;The acoustic properties of Ilmava products depend on their installation. In the wall installation, the sound gets through the panel and bounces back from the wall thus getting twice through the product. The acoustic characterisctics are then the same as those of fabric covered wall mounted Yeseco producs. In the free space installation, the sound gets through the product only once and the achieved attenuation is different, but now both surfaces absorb the sound and the absorption area is doubled.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;The Ilmava products are manufactured using standard Yeseco fabrics. The color of the fabric can be selected on each side individually, and even a photo printing is possible.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-family:Arial,Helvetica,sans-serif;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;There are two models of the Ilmava Table Screens: on the table standing one and on the table edge mounting one.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;margin-top:11.25pt&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;background:#f8f8f8&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:10.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;table class=&quot;Table&quot; style=&quot;width:237.0pt; border-collapse:collapse; border:solid silver 1.0pt&quot; width=&quot;316&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td style=&quot;border:solid silver 1.0pt&quot; valign=&quot;bottom&quot;&gt;\r\n			&lt;p align=&quot;center&quot; style=&quot;margin-bottom:0in; text-align:center; padding:3.75pt 7.5pt 3.75pt 7.5pt&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;Table edge mounting Ilmava Table Screen&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td style=&quot;border:solid silver 1.0pt; border-top:none&quot; valign=&quot;bottom&quot;&gt;\r\n			&lt;p align=&quot;center&quot; style=&quot;margin-bottom:0in; text-align:center; padding:3.75pt 7.5pt 3.75pt 7.5pt&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;line-height:normal&quot;&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-ser