(252, 1, 'Workstation - Work Pod', '&lt;p&gt;&lt;span style=&quot;background:#f8f8f8&quot;&gt;&lt;span style=&quot;line-height:17.35pt&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:13.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#393939&quot;&gt;&lt;span style=&quot;text-transform:uppercase&quot;&gt;&lt;span style=&quot;letter-spacing:.75pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height:17.35pt&quot;&gt;&lt;span style=&quot;vertical-align:baseline&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size:13.5pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#393939&quot;&gt;&lt;span style=&quot;text-transform:uppercase&quot;&gt;&lt;span style=&quot;letter-spacing:.75pt&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;small&gt;&lt;cite&gt;Modular pod  are perfect for holding meetings, brainstorming sessions to grow any business. A collection of flexible workspaces that screen you from sight and sound. Designed with a softer aesthetic and the ability to be customised, the collection consists of work pods and lounge pods.&lt;/cite&gt;&lt;/small&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;small&gt;&lt;cite&gt;Work pods provides spaces for individuals and groups to step into a quiet space, creating private workspaces without compromising your open office ideal. It not only has a series of standard panels that combine to create a multitude of configurations, it can be customised with differen