(264, 1, 'Humanscale Diffrient World', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size: 18px;&quot;&gt;&lt;b&gt;Stocks Available&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;b&gt;Use your coupon code upon checkout for further discount!&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;em&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;//www.youtube.com/embed/4NjVw4DdhO0&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/em&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Diffrient World is Humanscale\'s first foray into all-mesh task seating. Designer Niels Diffrient wanted to create the most minimal, full-function task chair ever made. With an innovative tri-panel mesh backrest that provides custom back and lumbar support and a lightweight design, Diffrient World is, like all of Humanscale’s products, simple, beautiful and functional. &lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;The design eliminates the need for traditional mechanisms, instead using the laws of physics and the sitter’s body weight to offer perfect recline for each individual sitter. Diffrient World offers the ultimate user-friendly sitting experience.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Stock Available&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Textiles &amp; Cushions - 5 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- All other Components - 15 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;CODE DESCRIPTION:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W1 World Task Chair&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;B - Black&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;1 - Adjustable Duron Arms&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M10 - Monofilament Stripe Black&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;CF10 - Corde 4 Black&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - Standard cylinder 125mm (5”)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - Standard Hard Casters&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - None-Standard Plastics &amp; Foams&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - Standard base to match frame color&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - Individually Boxed​​​​​​&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specification:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Mechanism-free recline action provides automatic, balanced support at all points throughout recline&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Form-Sensing Mesh Technology features tri-panel, non-stretch mesh construction for body-hugging comfort&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Low-abrasion mesh protects clothing while providing ultimate breathability&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Optional upholstered mesh seat cushion provides totally unique sitting experience&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Weight: 14kg (31 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Width: 660mm (26&quot;)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Base width: 610mm (24&quot;)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Humanscale Diffrient World', 'Diffrient World is Humanscale\'s first foray into all-mesh task seating. Designer Niels Diffrient wanted to create the most minimal, full-function task chair ever made. With an innovative tri-panel mesh backrest that provides custom back and lumbar support', 'Diffrient World is Humanscale\'s first foray into all-mesh task seating. Designer Niels Diffrient wanted to create the most minimal, full-function task chair ever made. With an innovative tri-panel mesh backrest that provides custom back and lumbar support'),
(265, 1, 'Veronica Deskmate UV monitor riser', '&lt;p&gt;&lt;em&gt;Germany TUV Authorized Detection&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:22px;&quot;&gt;&lt;span style=&quot;color:#e67e22;&quot;&gt;&lt;strong&gt;EX-STOCK&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;youtube-embed-wrapper&quot; style=&quot;position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden;&quot;&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;//www.youtube.com/embed/51a2TAdHyeU&quot; style=&quot;position: absolute;top: 0;left: 0;width: 100%;height: 100%;&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/div&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;&lt;span style=&quot;font-size:20px;&quot;&gt;UV Sterilization rate is higher than 99%&lt;/span&gt;&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;- Can be use as a USB charger to charge your electronic devices&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;br /&gt;\r\n- Built-in storage drawer to keep your cable wires, phones, keys and many more to keep your workdesk neat and tidy&lt;br /&gt;\r\n- Dimension: 551 x 345 x 135mm&lt;br /&gt;\r\n- Comes in 3 colour: Grey, Green and Camel.&lt;/span&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#ff0066;&quot;&gt;&lt;em&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;**TUV Certification on Microbiological Test**&lt;/span&gt;&lt;/em&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;No additional charges for delivery &amp; installation. &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Bulk Order Available&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Veronica Deskmate UV monitor riser', 'Veronica Deskmate UV monitor riser with multi-purpose usage. Other than Sterilization, it also has USB port for your to charge charge your electronic devices. The built-in storage drawer allows you to store things inside to ensure your workdesk are need a', 'Veronica Deskmate Monitor Riser System Furniture Seating Accessories Ergonomic UV Datumstruct'),
(266, 1, 'Humanscale M8.1 Single Monitor Arm', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;Pre-Order lead time between 6 to 8 weeks&lt;/span&gt;&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;b&gt;Use your coupon code upon checkout for further discount!&lt;/b&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;In today’s fast-paced, agile work environment, there’s no time for discomfort. M8.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks and sit/stand workstations alike, M8.1 meets a variety of configuration needs for single monitors from 6 to 28 pounds or – with an optional crossbar support – dual monitors up to 12 pounds each. Featuring innovations like Humanscale’s patented Weight-Compensating Spring Technology and Smart Stop functionality, M8.1 enables the personalization and flexibility needed for today’s evolving workplaces.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 6 - 8 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 15 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#000000;&quot;&gt;CODE DESCRIPTION:&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M81 - M8.1 Monitor Arm&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;CM - Two-Piece Clamp Mount with Base&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;W - Polished Aluminium with White Trim&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;B - Angled Link/Dynamic Link&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;T - Standard Monitor Tilt (one per monitor)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;B - Standard 100mm x 100mm, black&lt;/span&gt;&lt;br /&gt;\r\n &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Weight Capacity:&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Heavy Single or Dual Monitors 2.7 - 12.7 kg (6-28 lbs.)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Height Adjustment Range: Up to 305 mm (12&quot;)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Colour Options:&lt;br /&gt;\r\n• Polished Aluminium with White Trim&lt;br /&gt;\r\n• Silver with Grey Trim&lt;br /&gt;\r\n• Black with Black Trim&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Allows user to view their monitor(s) at an optimal position&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Rubberized Cable Management makes it simple to run cords through a modular system for a clean, sleek and organised aesthetic&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- A patented, weight-compensating spring technology enables smooth and uniform height adjustment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Built-in Counterbalance Indicator provides the ability to counterbalance the monitor weight before monitor installation to reduce expensive computer setup costs&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Patent-pending Smart Stop allows the user to customise the rotation of the arm, preventing overhang and protecting surrounding equipment&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Patent-pending Quick Release Joints instantly snap together for a secure and robust fit, simplifying installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Only one tool is required, and it’s neatly concealed inside the arm base&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Can be configured to hold up to three monitors&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Compatible with M/Connect 2 and M/Power, the first-ever integrated monitor arm bases and docking stations of their kind&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Humanscale M8.1 Single Monitor Arm', 'In today’s fast-paced, agile work environment, there’s no time for discomfort. M8.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks', 'In today’s fast-paced, agile work environment, there’s no time for discomfort. M8.1, part of Humanscale’s revolutionary new monitor arm line, instantly improves the comfort, health and productivity of any workspace. Fully compatible with traditional desks');
INSERT INTO `datumstruct_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(268, 1, '(HS) 11 WFH Package 01', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;WFH Package One&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;DIFFRIENT WORLD CHAIR + QuickStand Eco Single Monitor&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;em&gt;designed by Niels Diffrient&lt;/em&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;//www.youtube.com/embed/4NjVw4DdhO0&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Diffrient World is Humanscale\'s first foray into all-mesh task seating. Designer Niels Diffrient wanted to create the most minimal, full-function task chair ever made. With an innovative tri-panel mesh backrest that provides custom back and lumbar support and a lightweight design, Diffrient World is, like all of Humanscale’s products, simple, beautiful and functional.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;The design eliminates the need for traditional mechanisms, instead using the laws of physics and the sitter’s body weight to offer perfect recline for each individual sitter. Diffrient World offers the ultimate user-friendly sitting experience.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 3 to 4 weeks upon comfirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installtion &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 2 Years Warranty&lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;CODE DESCRIPTION&lt;br /&gt;\r\nW1 World Task Chair&lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;B - Black&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;1 - Adjustable Duron Arms&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;M10 - Monofilament Stripe Black&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;CF10 - Corde 4 Black&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - Standard cylinder 125mm (5”)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - Standard Hard Casters&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - None-Standard Plastics &amp; Foams&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - Standard base to match frame color&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- - Individually Boxed​​​​​​&lt;/span&gt;&lt;/p&gt;', '', '(HS) 11 WFH Package 01', 'WFH Package One\r\n\r\nDIFFRIENT WORLD CHAIR + QuickStand Eco Single Monitor\r\n\r\ndesigned by Niels Diffrient\r\n\r\nDiffrient World is Humanscale\'s first foray into all-mesh task seating. Designer Niels Diffrient wanted to create the most minimal, full-function ta', 'WFH Package One\r\n\r\nDIFFRIENT WORLD CHAIR + QuickStand Eco Single Monitor\r\n\r\ndesigned by Niels Diffrient\r\n\r\nDiffrient World is Humanscale\'s first foray into all-mesh task seating. Designer Niels Diffrient wanted to create the most minimal, full-function ta'),
(269, 1, '(HS) 13 WFH Package 03', '&lt;p&gt;WFH Package Three&lt;/p&gt;\r\n\r\n&lt;p&gt;Freedom Headrest + QuickStand Eco Single Monitor&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;div class=&quot;youtube-embed-wrapper&quot; style=&quot;position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden;&quot;&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;//www.youtube.com/embed/TjCfV2kvDig&quot; style=&quot;position: absolute;top: 0;left: 0;width: 100%;height: 100%;&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/div&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Described by The New York Times as &quot;the gold standard in office seating,&quot; the Freedom chair redefines the concept of traditional task chairs. Designer Niels Diffrient aimed to design an office chair that automatically adapts to the user, allowing them to move freely from posture to posture. Diffrient’s unique approach removed complexities found in other chairs, such as cumbersome recline levers and back tension dials for a truly ergonomic task chair. As a result, he developed a recline mechanism that perfectly adjusts to the user, definitively reinventing modern task seating to be truly simple, functional and beautiful.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Specification :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;F21 Freedom Task Chair with Headrest&lt;/p&gt;\r\n\r\n&lt;p&gt;1 - Standard Duron Arms&lt;/p&gt;\r\n\r\n&lt;p&gt;G - Graphite&lt;/p&gt;\r\n\r\n&lt;p&gt;CF10 - Corde 4 Black&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;No additional charges for delivery &amp; installation.&lt;/p&gt;', '', '(HS) 13 WFH Package 03', '', ''),
(270, 1, '(HS) 12 WFH Package 02', '&lt;p&gt;&lt;strong&gt;Ex-Stock Available&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;WFH Package Two&lt;/p&gt;\r\n\r\n&lt;p&gt;Liberty + QuickStand Eco Single Monitor&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;//www.youtube-nocookie.com/embed/hG74r9LQ9xo&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The Liberty Task chair is an intelligent mesh task chair engineered to provide automatic lumbar support for every user, as well offering simplicity and complete ease of use. Liberty was designed to offer a unique, minimal aesthetic and to provide custom comfort for every person who sits in it. Like Humanscale’s Diffrient Smart and Diffrient World chairs, Liberty uses Humanscale’s revolutionary Form-Sensing Mesh Technology and mechanism-free recline for perfect support and unprecedented comfort.&lt;/p&gt;\r\n\r\n&lt;p&gt;CODE DESCRIPTION&lt;/p&gt;\r\n\r\n&lt;p&gt;L11 Liberty Chair&lt;/p&gt;\r\n\r\n&lt;p&gt;1 - Adjustable Duron Arms&lt;/p&gt;\r\n\r\n&lt;p&gt;B - Black with Black Trim&lt;/p&gt;\r\n\r\n&lt;p&gt;M10 - Monofilament Stripe Black&lt;/p&gt;\r\n\r\n&lt;p&gt;CF10 - Corde 4 Black&lt;/p&gt;\r\n\r\n&lt;p&gt;- - No Stitching (Non-leathers only)&lt;/p&gt;\r\n\r\n&lt;p&gt;- - Standard Foam Seat Pan&lt;/p&gt;\r\n\r\n&lt;p&gt;- - Standard cylinder 125mm (5”)&lt;/p&gt;\r\n\r\n&lt;p&gt;- - Standard Hard Casters&lt;/p&gt;\r\n\r\n&lt;p&gt;- - None-Standard Plastics &amp; Foams&lt;/p&gt;\r\n\r\n&lt;p&gt;- - Standard Matching Base&lt;/p&gt;\r\n\r\n&lt;p&gt;- - Individually Boxed&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;No additional charges for delivery &amp; installation.&lt;/p&gt;', '', '(HS) 12 WFH Package 02', '', ''),
(271, 1, '(HS) 14 WFH Package 04', '&lt;p&gt;WFH Package Four&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:22px;&quot;&gt;H.A.T (Height Adjustable Table) + Freedom Headrest Chair + Monitor Arms&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;youtube-embed-wrapper&quot; style=&quot;position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden;&quot;&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;//www.youtube.com/embed/6oYLQDi_lxM&quot; style=&quot;position: absolute;top: 0;left: 0;width: 100%;height: 100%;&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;youtube-embed-wrapper&quot; style=&quot;position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden;&quot;&gt;Described by The New York Times as &quot;the gold standard in office seating,&quot; the Freedom chair redefines the concept of traditional task chairs. Designer Niels Diffrient aimed to design an office chair that automatically adapts to the user, allowing them to move freely from posture to posture. Diffrient’s unique approach removed complexities found in other chairs, such as cumbersome recline levers and back tension dials for a truly ergonomic task chair. As a result, he developed a recline mechanism that perfectly adjusts to the user, definitively reinventing modern task seating to be truly simple, functional and beautiful.&lt;/div&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Specification :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;1 x Height Adjustable Table&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;F21 Freedom Task Chair with Headrest&lt;/p&gt;\r\n\r\n&lt;p&gt;1 - Standard Duron Arms&lt;/p&gt;\r\n\r\n&lt;p&gt;G - Graphite&lt;/p&gt;\r\n\r\n&lt;p&gt;CF10 - Corde 4 Black&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;No additional charges for delivery &amp; installation.&lt;/p&gt;', '', '(HS) 14 WFH Package 04', '', ''),
(272, 1, '* Chairs Sales Promotion', '&lt;p&gt;Work from home with our great chairs!&lt;/p&gt;\r\n\r\n&lt;p&gt;The KEY to effective WFH&lt;/p&gt;\r\n\r\n&lt;p&gt;Listed Here is our D Curve Chair!&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Key to effective WFH V1&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Humanscale/2020.03.09/Key to effective WFH V1.png&quot; style=&quot;width: 300px; height: 750px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;D00203M黑色-01&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Chair/2020.03.09 updates from CX/Seating/E Mesh/D00203M黑色-01.jpg&quot; style=&quot;width: 250px; height: 362px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Shipping Details :&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;No additional charges for delivery &amp; installation. &lt;/p&gt;\r\n\r\n&lt;p&gt;Bulk Order Available&lt;/p&gt;', '', '* Chairs Sales Promotion', '', ''),
(274, 1, 'Interactive TV', '&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Giant screen HD display provides excellent visual experience &lt;br /&gt;\r\n2K full HD display presents exquisite and natural image &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;br /&gt;\r\nFull Lamination Technology*, 2K full HD display, 1920Hz/s refreshing frequency, lossless and natural static and motion graphics.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;youtube-embed-wrapper&quot; style=&quot;position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden;&quot;&gt;\r\n&lt;div class=&quot;youtube-embed-wrapper&quot; style=&quot;position:relative;padding-bottom:56.25%;padding-top:30px;height:0;overflow:hidden;&quot;&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;iframe allowfullscreen=&quot;&quot; frameborder=&quot;0&quot; height=&quot;360&quot; src=&quot;//www.youtube.com/embed/3B-j87Fghbw?autoplay=1&quot; style=&quot;position: absolute;top: 0;left: 0;width: 100%;height: 100%;&quot; width=&quot;640&quot;&gt;&lt;/iframe&gt;&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Keeping high grayscale in low brightness, and flexible and adjustable brightness and temperature design present clear and sharp images indoors and outdoors. &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;span style=&quot;color:#000000;&quot;&gt;160-degree visual angel make all position VIP seats&lt;/span&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;span style=&quot;color:#000000;&quot;&gt;160 degree horizontal and vertical visual angel provides board horizon*, making all position VIP seats. &lt;/span&gt;&lt;/l