(277, 1, 'Electronic Height Adjustable Table: Curve I', '&lt;p&gt;&lt;span style=&quot;font-size:18px;&quot;&gt;&lt;strong&gt;&lt;s&gt;Original Price $929&lt;/s&gt; , Now $559&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Use promo code to receive additional 20% Discount!&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;cite&gt;Minimalist design can be identified by a framework that’s is simple in nature, and that only the necessary elements for functionality are included.&lt;/cite&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Dimension : 1200 x 600&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Color : White and Black options available&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;Indicate your Color choice in comment box&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;img alt=&quot;WORKTOP PLAN _1200 x 600_&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/Shop/HAT Pesk Desk/WORKTOP PLAN _1200 x 600_.png&quot; style=&quot;width: 350px; height: 280px;&quot; /&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;Annotation 2020-05-20 105853&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/9am/Annotation 2020-05-20 105853.png&quot; style=&quot;width: 400px; height: 400px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;/span&gt;&lt;/strong&gt;&lt;img alt=&quot;Specs 2&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/9am/Specs 2.png&quot; style=&quot;width: 500px; height: 594px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;small&gt;&lt;big&gt;Contact our sales team now to find out more!&lt;/big&gt;&lt;/small&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&