(278, 1, 'Dynamic Smart Electric Height Adjustable Table', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;BIFMA &amp; GREENGUARD GOLD Certificate&lt;/strong&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Compliance.&lt;/strong&gt;&lt;/span&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;ANTI-MICROBIAL Table Top.&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;HAT Logo copy _1_&quot; class=&quot;img-responsive &quot; src=&quot;image/catalog/ds/prod/HAT Logo copy _1_.jpg&quot; style=&quot;width: 648px; height: 79px;&quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Experience the new level of work comfort with our all-in-one work desk featuring the soothing curve edge, height adjustable function and push notification that remind the user to transit between sit and stand. &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;br /&gt;\r\nEnjoy your workday with our Curve Series that is soothing to the eye and allows you to work in great comfort. Our Arc Curve Top feature a soft curve edge that gently goes around your wrists rather than forming a hard line against them.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Enhance with sit-stand adjustable feature that enable the user to change between sitting and standing. The frequent transition between sit and stand will help you to increase your productivity, improve your overall wellbeing, protect your spine and reduce the risk of aching &lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;for long hours of work from home or office.&lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;Availability :&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 2 to 3 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 5 years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications:&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;- Ergonomic Curve/Rectangular Shape Table Top using Formica Protec + Antimicrobial High Perfomance Premium Laminate product with an additional layer of hygienic protection to any environment through the utilization of antimicrobial properties of silver (Ag+). Effective against a broad Spectrum of microbes, prevents the growth of bacteria and fungi, providing a more hygienic surface and protecting against their potentially negative effects by stopping the cell division, damaging the bacteria/microbes structures. &lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;- 3 Column Height Adjustable Leg&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;- 3 preset memories with LED Screen and Up/Down Function&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;