(310, 1, 'Clover Highback', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;b&gt;Use your promotion code upon checkout for further discount!&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Every part of Clover was designed to ­ex and adjust to your body. The backrest’s top ­exing edge lets you comfortably rest your arm on top of the chair. The ­exing backrest encourages you to move and shift, allowing you to sit accordance to your body weight as well as height. And the ­exing back contours to support any posture your body needs at any given moment.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability :&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 2 to 3 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 2 Years Warranty&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications :&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- High Back Chair&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- PU Adjustable Armrest&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Self Weight Adjustment Synchro Mechanism&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Aluminium Base on Castors&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- (Head, Back, Seat) Stan