(370, 1, 'Steelcase Think Chair', '&lt;p&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Helvetica&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Smart. Simple. Sustainable. A chair that intuitively responds to the movement of the body, Think® was also the first product in the world to be granted the Cradle to Cradle® environmental certification.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Availability:&lt;/strong&gt;&lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;span style=&quot;color:#000000&quot;&gt;&lt;/span&gt;&lt;span style=&quot;color:#000000&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000&quot;&gt;- 2 - 3 weeks upon confirmation of order&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000&quot;&gt;- FREE delivery and installation&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;font color=&quot;#000000&quot;&gt;- Mechanisms, Pneumatic Cylinders/ Gas Lifts, Arm Caps, Foam, Castors/ Gllides, and Steel Frame - 12 Years Warranty&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;font color=&quot;#000000&quot;&gt;- Standard Textiles, Upholstery, Wood Veneer, Leather and acrylic from Steelcase, covering materials - 3 Years Warranty&lt;/font&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications :&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;-&lt;strong&gt