(383, 1, 'Loook N.A.P', '&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;(KEY IN PROMO CODE: DSWFH20)&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;b&gt;&lt;u&gt;N.A.P.&lt;/u&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;N.A.P. or Neuron Activation Pod is actually some next level scifi stuff. Equipped with groundbreaking Finnish technology from the company Neurosonic, this pod is a giant leap towards the office of the future. In recent years, many companies have started to realize the benefits of health and wellbeing in the workplace. Napping in the office has been actively encouraged in many workplaces for some time now, while different types of sleeping pods and silent capsules have been introduced on the market. A quick powernap can greatly improve employee concentration and productivity. N.A.P. is not only a silent capsule or a traditional nap pod. This pod helps you sleep better but it will also help you relax and recover, depending on which program you choose. It effectively decreases work related stress and ease pain.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;Instead of organizations investing in expensive wellness initiatives, maybe they could put their faith in technology? Good looking and great working technology. Some people say this product even helps to ease hangovers, but that is still to be proven scientifically.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;The technology is based on sensory tissue stimulation, very low frequency sinusoidal vibration, which is targeted simultaneusly to the whole body. Stimulation is extremely relaxing both physically and mentally. It is a research based proven and safe treatment with no side effects. The treatment brings a new dimension to ﬁxing stress b