quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;strong&gt;Specifications :&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- &lt;strong&gt;Extra High Back&lt;/strong&gt; Chair with headrest &lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- user able to switch between &lt;strong&gt;3 modes&lt;/strong&gt;: concentration, relaxation, and refresh without special operation.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- &lt;strong&gt;Built-in lumbar pad &lt;/strong&gt;on the back to enhance support. It has a moderate support feeling near the waist lumbar. The pad can be moved up and down by 50 mm (7 steps) to support the waist. You can adjust the height to suit your physique and taste.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- &lt;strong&gt;Adjustable seat depth &lt;/strong&gt;by the lever under the seat.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- 4 Direction &lt;strong&gt;Adjustable Armrest&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Aluminum die-cast mirror finish base with Nylon twin wheel casters are ideal for carpet floors.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;- Back Shell :  Black Reinforced nylon resin &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;- Color: (Back &amp; Seat) Sand Yellow (GC-Y3)&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;color:#000000;&quot;&gt;**Other color available upon request, contact us at 6546 9874&lt;/span&gt;&lt;span style=&quot;color:#000000;&quot;&gt;**&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;', '', 'Itoki Flip 