(908, 'customer.approve', '', 'sales@dsolutions.asia', '', '{store_name} - Your Account has been activated!', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;Welcome and thank you for registering at {store_name}!&lt;/p&gt; &lt;p&gt;Your account has now been created and you can log in by using your email address and password by visiting our website or at the following URL:&lt;/p&gt; &lt;p&gt;[button={account_url}]My account[/button]&lt;/p&gt; &lt;p&gt;Upon logging in, you will be able to access other services including reviewing past orders, printing invoices and editing your account information.&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(909, 'customer.credit', '', '', '', '{store_name} - Account Credit', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;You have received {amount} credit!&lt;/p&gt; &lt;p&gt;Your total amount of credit is now {total}.&lt;/p&gt; &lt;p&gt;Your account credit will be automatically deducted from your next purchase.&lt;/p&gt; &lt;p&gt;[button={account_url}]My account[/button]&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(910, 'customer.forgotten', '', '', '', '{store_name} - New Password', '&lt;p&gt;Dear customer,&lt;/p&gt; &lt;p&gt;A new password was requested for {store_name} customer account.&lt;/p&gt; &lt;p&gt;To reset your password click on the button below:&lt;/p&gt; &lt;p&gt;[button={reset_link}]Reset my password[/button]&lt;/p&gt; &lt;p&gt;The IP used to make this request was: {ip}&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(911, 'customer.register', '', '', '', '{store_name} - Thank you for registering', '&lt;p&gt;Welcome and thank you for registering at {store_name}!&lt;/p&gt;\r\n\r\n[if_approval]\r\n&lt;p&gt;Your account must be approved before you can login. Once approved you can log in by using your email address and password by visiting our website:&lt;/p&gt;\r\n[/if_approval]\r\n\r\n[if_not_approval]\r\n&lt;p&gt;Your account has now been created and you can log in by using your email address and password by visiting our website:&lt;/p&gt;\r\n[/if_not_approval]\r\n\r\n&lt;p&gt;[button={account_url}]My account[/button]&lt;/p&gt; &lt;p&gt;Upon logging in, you will be able to access other services including reviewing past orders, printing invoices and editing your account information.&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(912, 'customer.reward', '', '', '', '{store_name} - Reward Points', '&lt;p&gt;Hi {firstname},&lt;/p&gt; &lt;p&gt;You have received {amount} Reward Points!&lt;/p&gt; &lt;p&gt;Your total number of reward points is now {total}.&lt;/p&gt; &lt;p&gt;[button={account_url}]My account[/button]&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(913, 'customer.voucher', '', '', '', 'You have been sent a gift voucher from {from}', '[if_image]&lt;p&gt;{image}&lt;/p&gt;[/if_image]\r\n\r\n&lt;p&gt;Congratulations, You have received a Gift Certificate worth &lt;b&gt;{amount}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;This Gift Certificate has been sent to you by &lt;b&gt;{from}&lt;/b&gt;&lt;/p&gt;\r\n\r\n[if_message]&lt;p&gt;With a message saying:&lt;br&gt;{message}&lt;/p&gt;[/if_message]\r\n\r\n&lt;p&gt;&lt;b&gt;Redemption code:&lt;/b&gt; &lt;b&gt;{code}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;To redeem this Gift Certificate, write down the redemption code then click on the the link below and purchase the product you wish to use this gift voucher on. You can enter the gift voucher code on the shopping cart page before you click checkout.&lt;/p&gt; &lt;p&gt;[button={store_url}]{store_name}[/button]&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(914, 'enquiry.confirm', '', '', '', '{store_name} - Enquiry {enquiry_order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;Thank you for your interest in {store_name} products. Your enquiry has been received.&lt;/p&gt;&lt;p&gt;We will get back to you shortly.&lt;/p&gt;\r\n\r\n[if_customer]\r\n  &lt;p&gt;To view your enquiry click on the link below:&lt;/p&gt; &lt;p&gt;[button={enquiry_order_url}]My Enquiry[/button]&lt;/p&gt;\r\n[/if_customer]\r\n\r\n[if_download]\r\n  &lt;p&gt;[text_download_link]&lt;/p&gt; &lt;p&gt;[button={download_url}]My downloads[/button]&lt;/p&gt;\r\n[/if_download]\r\n  \r\n&lt;p&gt;{invoice}&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(915, 'order.confirm', '', '', '', '{store_name} - Order {order_id}', '&lt;p&gt;&lt;strong&gt;Hi {firstname},&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;Thank you for your interest in {store_name} products. Your order has been received and will be processed once payment has been confirmed.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;We will contact you to schedule the delivery within 2 working days.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n[if_customer]\r\n  &lt;p&gt;To view your order click on the link below:&lt;/p&gt; &lt;p&gt;[button={order_url}]My order[/button]&lt;/p&gt;\r\n[/if_customer]\r\n\r\n[if_download]\r\n  &lt;p&gt;[text_download_link]&lt;/p&gt; &lt;p&gt;[button={download_url}]My downloads[/button]&lt;/p&gt;\r\n[/if_download]\r\n  \r\n&lt;p&gt;{invoice}&lt;/p&gt; &lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(916, 'order.return', '', '', '', '{store_name} - Return Update {return_id}', '&lt;p&gt;&lt;strong&gt;Dear customer,&lt;/strong&gt;&lt;/p&gt; &lt;p&gt;Your return &lt;b&gt;#{return_id}&lt;/b&gt; has been updated to the following status: &lt;b&gt;{order_status}&lt;/b&gt;&lt;/p&gt;\r\n\r\n[if_message]\r\n&lt;p&gt;The comments for your order are:&lt;/p&gt; &lt;p&gt;{message}&lt;/p&gt;\r\n[/if_message]\r\n\r\n&lt;p&gt;Best regards,&lt;br&gt;{store_name}&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(917, 'admin.customer.register', '', '', '', 'New customer', '&lt;p&gt;A new customer has signed up:&lt;/p&gt; &lt;p&gt;&lt;/p&gt;&lt;table&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td style=&quot;width:43%&quot;&gt;Web Site:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{store_url}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;Customer Group:&amp;nbsp;&lt;/td&gt;&lt;td&gt;&lt;b&gt;{customer_group}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;First Name:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{firstname}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;Last Name:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{lastname}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;E-Mail:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{email}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;tr&gt;&lt;td&gt;Telephone:&lt;/td&gt;&lt;td&gt;&lt;b&gt;{telephone}&lt;/b&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;p&gt;&lt;/p&gt; &lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(918, 'admin.enquiry.confirm', '', '', '', '{store_name} - Enquiry {enquiry_order_id}', '&lt;p&gt;You have received an Enquiry.&lt;/p&gt; &lt;p&gt;Enquiry Status: &lt;b&gt;{order_status}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;{invoice}&lt;/p&gt;', '', '', 1, 0),
(919, 'admin.information.contact', '', '', '', 'Enquiry - {enquiry_subject}', '&lt;p&gt;You received a new enquiry.&lt;/p&gt; &lt;p&gt;&lt;b&gt;Name:&lt;/b&gt; {enquiry_name}&lt;br&gt;&lt;b&gt;Email:&lt;/b&gt; {enquiry_mail}&lt;br&gt;&lt;b&gt;Telephone:&lt;/b&gt;&amp;nbsp;{enquiry_telephone}&lt;/p&gt; &lt;p&gt;&lt;b&gt;Message:&lt;/b&gt;&lt;br&gt;{enquiry_message}&lt;/p&gt; &lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', '', 1, 0),
(920, 'admin.order.confirm', '', '', '', '{store_name} - Order {order_id}', '&lt;p&gt;You have received an order.&lt;/p&gt; &lt;p&gt;Order Status: &lt;b&gt;{order_status}&lt;/b&gt;&lt;/p&gt; &lt;p&gt;{invoice}&lt;/p&gt;', '', '', 1, 0),
