INSERT INTO `datumstruct_sb_ncategory_description` (`ncategory_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES
(59, 1, 'Humanscale', '&lt;p&gt;We are known for our history of collaboration with the legendary designer Niels Diffrient, who designed many of our task chairs, including the iconic Freedom chair -- the first self-adjusting chair without manual knobs and levers. We also partner with other esteemed industrial designers, including Don Chadwick and Todd Bracher. Our innovations have been honored with more than 200 prestigious awards since 2007 and featured in various museums, such as the Museum of Modern Art. &lt;/p&gt;', '', ''),
(60, 1, 'Seating', '', '', ''),
(61, 1, 'Work Station', '', '', ''),
(63, 1, 'Loose Furniture', '', '', ''),
(65, 1, 'Loook', '&lt;p&gt;It’s 2009. Two young designers sit in a noisy lounge, struggling to discuss latest design trends. The surrounding buzz turns their talk to the mounting pressures of modern life: the noise, the distractions, the inability to concentrate, the difficulty of conducting conversations, the “always-on” culture of mobile lifestyles.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;In a moment of inspiration, Ivar Gestranius and Kevin Lahtinen start sketching out ideas for furniture that could help distracted people find privacy in busy places.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;Today, going beyond privacy, Loook also brings new design ideas that encourage interaction and collaboration. Through its thoughtful designs, Loook adds creative new ways for employees to work, both on their own and in teams. Loook also transforms public spaces to make them more&lt;/p&gt;\r\n\r\n&lt;p&gt;appealing, useful, and loved.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;We are Loook Industries&lt;/strong&gt;&lt;/h3&gt;', '', ''),
(67, 1, 'Framery', '&lt;p&gt;Our products including pods, phone booths and soundproof private spaces solve noise and privacy issues in open offices, making employees happier and more productive in dozens of the world’s leading companies, including Microsoft, Puma and Tesla. In fact, 40% of all Forbes 100 companies use Framery.&lt;/p&gt;', '', ''),
(68, 1, 'Acoustic Panel', '', '', ''),
(69, 1, 'Seatings', '', 'Seatings', 'Seatings'),
(70, 1, 'Loose Furniture', '', 'Loose Furniture', 'Loose Furniture');
