(10316, 0, 'aboutus', 'aboutus_items_1', '[{\"tab\":\"Our Story\",\"desc\":\"&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;About us&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/b&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;As a leading space planner and system furniture provider, our commitment to servicing our client is rooted in our reliable performance. We excel in sales service by equipping ourselves with in-depth product knowledge and always understand our client\\u2019s need. With our longstanding reputation and expertise in the industry, this sets us apart and allows us to provide the top-quality service and solutions to all our clients.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/b&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;Our story&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/b&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;It was in &lt;em&gt;2011&lt;\\/em&gt; and there were only &lt;em&gt;3&lt;\\/em&gt; employees working in the office, one being our Managing Director, one being General Manager and the other being our interior illustrator.\\u00a0 Thou the team was small; it had not stopped us from closing our first million-dollar deal which enabled expansion of our workforce to more than 700% as compared to initial start-up. Recognized in the market as trendsetters, we are honoured with collaboration invites\\u00a0from\\u00a0pioneer leader of office ergonomics equipment created by renowned designer with presence in more than 28 countries. While we continue to provide more sophisticated and premium product, we were also making our ways on getting projects awarded by listed companies and various trades market leaders around the world.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;Work and the way we do is changing quickly. We understand that whatever we are learning about good working methods soon become obsolete. What was define as good working environment soon evolved to many other aspects. This new expectation gave us opportunities to be the first in the market bringing in acoustic panels and phone booths. We received a lot of great feedback on how our products made a person happy at work and how it increased their productivities and sales production. &lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-size:12.0pt&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;Our success today remains as our pride, and we always strive not just being great, but to be simply the best.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:150%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\",\"image\":\"catalog\\/ds\\/prod\\/Workstations\\/4 - Height Adjustable Table\\/about us bottom.jpg\"},{\"tab\":\"Our Core Values\",\"desc\":\"&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;Our Mission&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;Our Why&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;To create sustainable workspace interior furnishing solutions ensuring high productivity and maximise every investment in every working&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt; environment and opportunity.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;big&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;b&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;Our Vision&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/b&gt;&lt;\\/span&gt;&lt;\\/big&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;big&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;b&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;Our How&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/b&gt;&lt;\\/span&gt;&lt;\\/big&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;We work towards becoming the market leader of office system furniture solutions with innovative personalised, flexibility and consistency in our service and quality to meet the demands of our clients.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;big&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;b&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;Our Core Values&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/b&gt;&lt;\\/span&gt;&lt;\\/big&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;big&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;b&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;Our Values&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/b&gt;&lt;\\/span&gt;&lt;\\/big&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;span style=&quot;background:white&quot;&gt;&lt;span style=&quot;line-height:107%&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;span style=&quot;color:#666666&quot;&gt;We see our own reflection from the mirror and see integrity, honesty and trust. We believe that ethical is never an option and we honour and respect each other. We never stop collaborating, exploring which make us unstoppable. We are always looking to learn, grow, innovate and excel and exceed.&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\",\"image\":\"catalog\\/ds\\/prod\\/Workstations\\/4 - Height Adjustable Table\\/about us bottom.jpg\"},{\"tab\":\"\\u200bWhy Choose Us?\",\"desc\":\"&lt;p&gt;&lt;strong&gt;Our Expertise &amp;\\u00a0Innovation&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;ul&gt;\\r\\n\\t&lt;li&gt;Recognition of Commercial Projects&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Innovative Office System Furniture Solutions&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;High Level of Product Quality and Creativity&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Innovative System\\u2019s Design &amp; Concept Realization&lt;\\/li&gt;\\r\\n&lt;\\/ul&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;Advantages of Our Products&lt;\\/strong&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;ul&gt;\\r\\n\\t&lt;li&gt;Reliable&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Flexible&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Consistent&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Excellent Customer Service&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Extensive Experience&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Concept Realizations via 3D Drawings&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;On-Site Support&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Site Mock Up Presentation&lt;\\/li&gt;\\r\\n\\t&lt;li&gt;Strategic Partnership&lt;\\/li&gt;\\r\\n&lt;\\/ul&gt;\\r\\n\",\"image\":\"catalog\\/ds\\/prod\\/Workstations\\/4 - Height Adjustable Table\\/about us bottom.jpg\"},{\"tab\":\"Privacy Policy\",\"desc\":\"&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;This Privacy Policy (the \\u201cPolicy\\u201d) applies to the collection, use and disclosure of an individual customer\\u2019s Personal Data (hereinafter defined) arising from goods and\\/or services offered by Datumstruct Solutions Pte Ltd.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;1. What information do we collect?&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;1.1. We collect information from you when you register on our site, place an order or subscribe to our newsletter.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;1.2. When ordering or registering on our site, as appropriate, you may be asked to enter your: name, e-mail address, mailing address or phone number. You may, however, visit our site anonymously.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;br \\/&gt;\\r\\n&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2. What do we use your information for?&lt;\\/span&gt;&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2.1 Any of the information we collect from you may be used in one of the following ways:&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:60.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2.1.1. To personalize your experience (your information helps us to better respond to your individual needs)&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:60.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2.1.2. To improve our website (we continually strive to improve our website offerings based on the information and feedback we receive from you)&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:60.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2.1.3. To improve customer service (your information helps us to more effectively respond to your customer service requests and support needs)&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:60.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2.1.4. To process transactions (Your information, whether public or private, will not be sold, exchanged, transferred, or given to any other company for any reason whatsoever, without your consent, other than for the express purpose of delivering the purchased product or service requested).&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:60.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2.1.5. To send periodic emails (The email address you provide for order processing, will only be used to send you information and updates pertaining to your order).&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;3. How do we protect your information?&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;3.1. We implement a variety of security measures to maintain the safety of your personal information when you place an order or enter, submit, or access your personal information.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;3.2. We offer the use of a secure server. All supplied sensitive\\/credit information is transmitted via Secure Socket Layer (SSL) technology and then encrypted into our Payment gateway providers database only to be accessible by those authorized with special access rights to such systems, and are required to keep the information confidential.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;3.3. After a transaction, your private information (credit cards, social security numbers, financials, etc.) will not be stored on our servers.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4. Do we use cookies?&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4.1. Yes (Cookies are small files that a site or its service provider transfers to your computer\\u2019s hard drive through your Web browser (if you allow) that enables the sites or service providers systems to recognize your browser and capture and remember certain information.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4.2. We use cookies to help us remember and process the items in your shopping cart and understand and save your preferences for future visits.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-top:5.0pt; margin-right:0cm; margin-bottom:12.0pt; margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4.3. If you prefer, you can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies via your browser settings. Like most websites, if you turn your cookies off, some of our services may not function properly. However, you can still place orders over the telephone or by contacting customer service.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;5. Do we disclose any information to outside parties?&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;5.1. We do not sell, trade, or otherwise transfer to outside parties your personally identifiable information. This does not include trusted third parties who assist us in operating our website, conducting our business, or servicing you, so long as those parties agree to keep this information confidential. We may also release your information when we believe release is appropriate to comply with the law, enforce our site policies, or protect ours or others rights, property, or safety. However, non-personally identifiable visitor information may be provided to other parties for marketing, advertising, or other uses.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;br \\/&gt;\\r\\n&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;6. Third party links&lt;\\/span&gt;&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;6.1. Occasionally, at our discretion, we may include or offer third party products or services on our website. These third party sites have separate and independent privacy policies. We therefore have no responsibility or liability for the content and activities of these linked sites. Nonetheless, we seek to protect the integrity of our site and welcome any feedback about these sites.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;br \\/&gt;\\r\\n&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;7. Personal Data Protection Act (Singapore)&lt;\\/span&gt;&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;7.1. By using this site, you agree to allow us to collect or use your information in an appropriate manner in accordance to the Personal Data Protection Act of Singapore.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;br \\/&gt;\\r\\n&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;8. Online Privacy Policy Only&lt;\\/span&gt;&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;8.1. This online privacy policy applies only to information collected through our website and not to information collected offline.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;br \\/&gt;\\r\\n&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;9. Terms and Conditions&lt;\\/span&gt;&lt;\\/strong&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;9.1. Please also visit our Terms and Conditions section establishing the use, disclaimers, and limitations of liability governing the use of our website.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;10. Your Consent&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quo