ot;&gt;1.1 WWW.DOSLUTIONS.ASIA\\u00a0is a site operated by Datumstruct Solutions Pte Ltd. We are registered in Singapore under the Business Registration Number 201105209R\\u00a0and with our registered office at Datumstruct Solutions Pte Ltd. Our GST Registration Number is Datumstruct Solutions Pte Ltd.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2. Service Availability&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;2.1 Our site is only intended for use by people residing, businesses, and companies in Singapore (&quot;the Serviced Country&quot;). We do not accept orders from individuals outside of the Serviced Country.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;3. Your Status&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;3.1 By placing an order through our site or on the telephone, you warrant that:&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:60.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;3.1.1 You are legally capable of entering into binding contracts;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:60.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;3.1.2 You are resident in the Serviced Country.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4. How the Contract is formed between You and Us&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4.1 After placing an online order, you will receive an e-mail from us acknowledging that we have received your order. Please note that this does not mean that your order has been accepted. Your order constitutes an offer to us to buy a Product. All telephone and on-line orders are subject to acceptance by us, and we will confirm such acceptance to you either during our telephone conversation or email. The contract between us (\\u201cthe Contract\\u201d) will only be formed when we deliver the items to you.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4.2 Subjected to actual stock availability, item orders may be replaced with alternatives subjected to a verbal or written confirmation with you. For items that cannot be replaced, we will contact you to give you the option to cancel. If payment has been made, you will be refunded of the amount paid. &lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4.3 All orders placed online will be fulfilled within 21 business days unless otherwise advised. Business days exclude Saturday, Sunday and Public Holidays.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4.4 You are obliged to make payment in FULL by the payment option you select when you check out your orders.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;4.5 Each batch of goods may differ due to manufacturing contraints. In the event if you are not satisfied with any products, you may return to us within 7 days after delivery. The Product must be unused in the Original condition and it must not be pre-order product. Please refer to our refund policy stated under &quot;Our Refunds Policy&quot;.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;5. Our Status&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;5.1 We may provide links on our site to the websites of other companies, whether affiliated with us or not. We cannot give any undertaking that the products you purchase from companies to whose website we have provided a link will be of satisfactory quality.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;6. Price and Payment&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;6.1 The price of any Products will be as quoted on our site from time to time, except in cases of obvious error.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;6.2 Our site contains a large number of Products and it is always possible that, despite our best efforts, some of the Products listed on our site may be incorrectly priced. We will normally verify prices as part of our dispatch procedures so that, where a Product\'s correct price is less than our stated price, we will charge the lower amount when dispatching the Product to you. If a Product\\u2019s correct price is higher than the price stated on our site we might at our discretion decide to honour the lower (incorrect) price or either contact you for instructions before dispatching the Product, or reject your order and notify you of such rejection.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;6.3 We are under no obligation to provide the Product to you at the incorrect (lower) price even after we have provided you with an email confirmation.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;7. Our Refunds Policy&lt;\\/span&gt;&lt;\\/strong&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;7.1 When you return a Product to us (for instance, because you have cancelled the Contract between us, or have notified us that you do not agree to any change in these Terms and Conditions or in any of our Policies, or because you claim that the Product is defective), we will examine the returned Product.The condition of the product eligible for return must be in excellent condition, original packaging is not damaged, no missing parts (including replacement parts with the package), and we do not accept partially assembled products.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;7.2 Products returned by you because of a defect or within the seven-day period will be refunded in full after delivery costs have been deducted.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;7.3 A claim by you that the quantity of the Products delivered falls short of the quantity ordered shall be notified to us within 2 days from the date of delivery. If you do not notify us accordingly, we shall have no liability in respect of such shortfall and you shall be bound to pay the price as if the Products had been delivered in accordance with the Contract.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;&lt;span style=&quot;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;7.4 The cost of return transportation and any transaction fee chargable\\u00a0is at your expense.&lt;\\/span&gt;&lt;\\/p&gt;\\r\\n\\r\\n&lt;p style=&quot;margin-left:30.0pt&quot;&gt;7.5\\u00a0You are responsible for properly packing and shipping your return products. Please follow our return instructions. We are not responsible for any returns that are lost,damaged or rejected because you did not follow the return instructions.&lt;\\/p&gt;\\r\\n